"use strict";(self.webpackChunkbublik_release=self.webpackChunkbublik_release||[]).push([[4389],{4390:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"release-v1.0.2","metadata":{"permalink":"/bublik-release/blog/release-v1.0.2","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-12-04-release-v1.0.2/index.mdx","source":"@site/blog/2024-12-04-release-v1.0.2/index.mdx","title":"Release v1.0.2","description":"\ud83c\udf89 We are thrilled to announce Bublik v1.0.2! \ud83c\udf89","date":"2024-12-04T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":6.78,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null},{"name":"Rybchenko Natalia","title":"Bublik Backend Maintainer","url":"https://github.com/ol-nata","imageURL":"https://github.com/ol-nata.png","key":"ol-nata","page":null}],"frontMatter":{"title":"Release v1.0.2","authors":["okt-limonikas","ol-nata"],"tags":["release"],"slug":"release-v1.0.2"},"unlisted":false,"nextItem":{"title":"Release v0.7.0","permalink":"/bublik-release/blog/release-v0.7.0"}},"content":"\ud83c\udf89 **We are thrilled to announce Bublik v1.0.2!** \ud83c\udf89\\n\\nThis release brings mainly internal changes with some enhancements to report and measurements views.\\n\\n\ud83d\udd0d **Key Highlights**:\\n\\n- **Log Preview**: Easily open the log preview by clicking on a report table cell or a chart point.\\n- **Run Header Group Labels**: Added labels for expected and unexpected results to make columns easier to understand and reduce confusion.\\n- **Import Performance**: The speed of importing runs with streaming measurements has increased 3.5 times.\\n- **Measurements**: All measurement results are displayed, with the format adapted to views and their specific context.\\n\\n\x3c!--truncate--\x3e\\n\\n## Highlights\\n\\n### Report Table & Chart\\n\\n:::info\\nPress `Ctrl` to scroll inside table or zoom chart\\n:::\\n\\n![Report](./img/report-table.png)\\n\\n### Report Log Preview\\n\\n![Report Preview](./img/report-log-preview.png)\\n\\n### History Preview\\n\\n![History Preview](./img/history-preview.png)\\n\\n### Run Header Groups\\n\\n![Run Header Groups](./img/run-headers.png)\\n\\n### Measurement Results\\n\\n![Measurement Results](./img/measurements.png)\\n\\n## Admin Section\\n\\n:::tip\\nBefore starting the update, create a database backup to ensure data safety in case of any unexpected issues during the process.\\n:::\\n\\n### Backend Update\\n\\n#### Base Steps\\n\\n1. `cd bublik`\\n2. `git remote update`\\n3. `git checkout v1.0.2`\\n4. `./scripts/deploy --steps pip_requirements migrate_db django_settings run_services`\\n\\n#### Additional Steps\\n\\n:::tip\\nSince data migration can take a long time, stop side services to avoid potential disruptions or conflicts during the migration process: `./scripts/deploy --steps run_side_servers` + `stop`. Restart them once the process is complete: `./scripts/deploy --steps run_side_servers` + `start`.\\n:::\\n\\n:::tip\\nDuring the update, use `tmux` or `screen` to keep your session running in the background, ensuring it won\u2019t be interrupted if the connection is lost.\\n:::\\n\\n1. Activate the virtual environment: `source .env/bin/activate`\\n2. Call the configuration reformatting command: `python manage.py reformat_configs`\\n   :::warning\\n   Configurations whose automatic formatting has failed will not be supported by Bublik. Either reformat them manually or delete.\\n   :::\\n3. Call the database cleanup command: `python manage.py cleanup_db`\\n\\n### Frontend Update\\n\\n1. Trigger the workflow in your frontend repository.\\n2. Synchronize the mirrors.\\n3. `cd bublik-ui`\\n4. `git remote update`\\n5. `git checkout v1.0.2`\\n\\n### Additional\\n\\n:::danger\\nIt is necessary to re-import runs that was imported when Bublik was using versions v0.6.0 to v1.0.0 to avoid potential errors in statistical calculations and charts in history.\\n:::\\n\\n:::danger\\nAvoid reverting to earlier versions after upgrading to v1.0.*, as this could lead to irreversible data loss.\\n:::\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **measurements:** added endpoint and types for single measurement plot ([3b8df42](https://github.com/ts-factory/bublik-ui/commit/3b8df42ec891fab6b79d03753b94268c3cee6085))\\n- **measurements:** added new chart component ([68f68c5](https://github.com/ts-factory/bublik-ui/commit/68f68c5be72bbaa6b0dc513ad78491e5e0fa52f9))\\n- **measurements:** added new stacked chart component ([513d581](https://github.com/ts-factory/bublik-ui/commit/513d5812575adda43befa13cecf06b23bdacc57d))\\n- **report:** [chart] open point info dialog when clicking on point ([840d9f9](https://github.com/ts-factory/bublik-ui/commit/840d9f9a90859f7c50ac2aaa0d515931a1c56507))\\n- **report:** [table] open point info dialog when clicking on table cell ([a1c8dcb](https://github.com/ts-factory/bublik-ui/commit/a1c8dcb6e8cf9744eb4546cba09aeddc4774ceab))\\n- **report:** added drawer with point information component ([c8c9450](https://github.com/ts-factory/bublik-ui/commit/c8c9450371d8b60bf62da361b356d4be5b1acbbe))\\n- **run:** added header groups to show difference between columns ([505d798](https://github.com/ts-factory/bublik-ui/commit/505d798b82843075b4f26ed49d8be1a0c98da20a)), closes [#175](https://github.com/ts-factory/bublik-ui/issues/175)\\n- **run:** added screen reader only label for \\"add note\\" button ([9ba0120](https://github.com/ts-factory/bublik-ui/commit/9ba01208a6cca5ed5b5650280cfb6c5a6dcc3e69))\\n- **ui:** [chart] allowed to override default options for chart ([bd65b92](https://github.com/ts-factory/bublik-ui/commit/bd65b92df0a6eefd25a64b204fb6271f7969bbf9))\\n- **utils:** added controllable state hook ([dc885dd](https://github.com/ts-factory/bublik-ui/commit/dc885ddb4b5b5e91f90b772030a1429472636c80))\\n- **utils:** added platform specific ctrl key hook ([3e92144](https://github.com/ts-factory/bublik-ui/commit/3e92144c76159513f4e8c6a511d7d9e49ecffaf1))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **report:** [chart] made chart take as much space as possible ([74df1e5](https://github.com/ts-factory/bublik-ui/commit/74df1e52d89436cd740233dfa81176f9e0e2abee))\\n- **report:** [table] made columns take 50% of width when only have one series ([b04ce9b](https://github.com/ts-factory/bublik-ui/commit/b04ce9b81ed5f36785f3fcddb706d68891005dfc))\\n- **run:** adjusted offset for sticky rows ([bf47f87](https://github.com/ts-factory/bublik-ui/commit/bf47f87fb3d0d1f11fc1f007dae3bf20f43f0ed5))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **history:** fixed history chart resetting zoom when releasing modifier key ([a8c47ca](https://github.com/ts-factory/bublik-ui/commit/a8c47cad6c461f1c0a52789324fc83dd6c4711f6))\\n- **log:** fixed crash when failing to retrieve node name ([5cf78e9](https://github.com/ts-factory/bublik-ui/commit/5cf78e924fc308257086e826447176bd51cafe61))\\n- **report:** [chart] added margin between legend and grid ([cda1f19](https://github.com/ts-factory/bublik-ui/commit/cda1f195f8bcaa732d6266134bf200e0ec10a0a3))\\n- **report:** [chart] display y_axis label when `series_label` is `null` ([567b059](https://github.com/ts-factory/bublik-ui/commit/567b05900a22adb7c90bf01982a6f73a3ae83bc7))\\n- **report:** [chart] don\'t show legend when series label is `null` ([f96bcc4](https://github.com/ts-factory/bublik-ui/commit/f96bcc48d3944ced1621440f1ea35e211c66a23e))\\n- **report:** [chart] fixed incorrect values on x axis ([1ee4da5](https://github.com/ts-factory/bublik-ui/commit/1ee4da5c75189e3535f895c82871f00c9971764f))\\n- **report:** [chart] fixed zoom reset on ctrl + scroll ([fbb976b](https://github.com/ts-factory/bublik-ui/commit/fbb976bf300866a9555e26dfdf25ef3004fb0de2))\\n- **report:** [table] incorrect table first series name ([55d576c](https://github.com/ts-factory/bublik-ui/commit/55d576cb4e2004b9066c048b45b67f48fa48b70b))\\n- **run:** fixed text comment popover being on partially shown ([e803cd9](https://github.com/ts-factory/bublik-ui/commit/e803cd9e8589ba5b042cfb598fb6601acaf1e6ed))\\n\\n#### \u267b\ufe0f Code Refactoring\\n\\n- **history:** adjusted history for new data, types and components ([38b2aab](https://github.com/ts-factory/bublik-ui/commit/38b2aab81aa23c90798f8cb3536fad0392a22e81))\\n- **history:** changed to new log preview for stacked charts ([a3d00d3](https://github.com/ts-factory/bublik-ui/commit/a3d00d3204c766610a272b7d10ae2fb6b1abd55e))\\n- **history:** swap for new preview drawer modal ([6e40b79](https://github.com/ts-factory/bublik-ui/commit/6e40b79522bc1d40445488b21e66ffa87a955fbc))\\n- **history:** use new stacked chart for history stacked mode ([1734d69](https://github.com/ts-factory/bublik-ui/commit/1734d698e896eb3c18944f5eb0e04df309850a77))\\n- **log:** extracted log preview component to separate lib ([89007fb](https://github.com/ts-factory/bublik-ui/commit/89007fb3b78dccdd0cdf2b00b592e87c1c266e12))\\n- **measurements:** adjusted export logic for new types and data ([ea2e5a4](https://github.com/ts-factory/bublik-ui/commit/ea2e5a42b270b732882eec444072a89a913ade60))\\n- **measurements:** adjusted getting chart name ([9d94e70](https://github.com/ts-factory/bublik-ui/commit/9d94e70a9ae371bba8f569b9b6bd0963be209f6e))\\n- **measurements:** adjusted measurement charts for new types and data ([4687d47](https://github.com/ts-factory/bublik-ui/commit/4687d47b57d00e657fd677e2b2de0ed5633f9832))\\n- **measurements:** adjusted measurements page for new data and types ([20bc843](https://github.com/ts-factory/bublik-ui/commit/20bc843a2d8672283ec02418e81f804b418da104))\\n- **measurements:** adjusted table for new data and types ([245e370](https://github.com/ts-factory/bublik-ui/commit/245e37033f11658a65e2959452a8305c850d1d36))\\n- **measurements:** use new stacked chart component for overlay mode ([343abce](https://github.com/ts-factory/bublik-ui/commit/343abce62608a3cf0f707920de34881edbea7148))\\n- **report:** [chart] allow zoom only when metaKey is pressed ([d3e7fe0](https://github.com/ts-factory/bublik-ui/commit/d3e7fe0b24662b41cf906d53f9a0362c9c907cc8))\\n- **report:** [chart] updated chart for API changes ([b427854](https://github.com/ts-factory/bublik-ui/commit/b427854469a28ed2d4cb5f5fa9ae7e7628a89207))\\n- **report:** [table] allow scroll only when ctrl or meta key is pressed ([0451a1f](https://github.com/ts-factory/bublik-ui/commit/0451a1f566d802ea3c7eb98ba2a939f9611539aa))\\n- **report:** adjusted logic for determining labels ([0193a07](https://github.com/ts-factory/bublik-ui/commit/0193a07051372b4b467c55820c2257cd4a89f36e))\\n- **report:** adjusted props to chart and table ([ba47278](https://github.com/ts-factory/bublik-ui/commit/ba47278b888932ca5da501280d2a00304a40e33b))\\n- **report:** changed location of warnings hover cards ([154d577](https://github.com/ts-factory/bublik-ui/commit/154d577cfeadd4f93ab41dce14e600cbac3b113d))\\n- **report:** use shared drawer dialog for log preview ([03f4d05](https://github.com/ts-factory/bublik-ui/commit/03f4d05b8babca7555bd8e881323548092e9396b))\\n\\n#### \ud83d\udce6 Chores\\n\\n- **history:** removed old plot point dialog ([5613e2f](https://github.com/ts-factory/bublik-ui/commit/5613e2faf081e68a8770a2ecfb1357830bdcd359))\\n- **measurements,history:** remove old dead code and types ([fc20033](https://github.com/ts-factory/bublik-ui/commit/fc200338d2cf08c8c2426642bb775d18c7d8b939))\\n- **report:** adjusted report types for new API changes ([b58ed3b](https://github.com/ts-factory/bublik-ui/commit/b58ed3b18d9ce93132cb4b12713afba67a095e34))\\n- **report:** changed labels for list of arguments ([69ababb](https://github.com/ts-factory/bublik-ui/commit/69ababb263794ab628cb4fd56f10b11d88f13186))\\n- **report:** display spinner when loading report ([2833e2e](https://github.com/ts-factory/bublik-ui/commit/2833e2e405a47b3f0cc6ed0c30458307f11a2247))\\n- **report:** removed old point dialog drawer component ([c27c225](https://github.com/ts-factory/bublik-ui/commit/c27c22583811e95d02c4002696b83f10ad816aea))\\n\\n### Backend\\n\\n#### \ud83d\udd28 Issue Fix\\n\\n- Add API spec docs (OpenAPI Specification v3.x) [#38](https://github.com/ts-factory/bublik/issues/38)\\n- Report: add navigation from points [#74](https://github.com/ts-factory/bublik/issues/74)\\n- Measurements: improve the processing and storage of sequences of results [#79](https://github.com/ts-factory/bublik/issues/79)\\n- Measurements: update the structure of data to display [#80](https://github.com/ts-factory/bublik/issues/80)\\n- Update the requirements [#90](https://github.com/ts-factory/bublik/issues/90)\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **importruns:** fix iteration end date calculation ([2b82dea](https://github.com/ts-factory/bublik/commit/2b82deaa26f6fa518c28f2ff7a4b4d0274cc088b))\\n- **importruns:** fix iteration start and end dates calculation ([56d7bd2](https://github.com/ts-factory/bublik/commit/56d7bd21f7d5e0a30e99c5fde523e784da36be9e))\\n- **importruns:** fix views saving ([d2ee1ab](https://github.com/ts-factory/bublik/commit/d2ee1abd1fc0f7273d1aa2ff2c557386b7d187d7))\\n- **importruns:** fix views handling ([7b94b98](https://github.com/ts-factory/bublik/commit/7b94b98e524f539b131ecd1c34b5e237cbf3592a))\\n- **measurements:** fix response for the case of an error ([4133a7e](https://github.com/ts-factory/bublik/commit/4133a7ee477e022f48993f36f12552e4683c4fc8))\\n- **report:** fix the calculation of percentages ([0601f1b](https://github.com/ts-factory/bublik/commit/0601f1b68d848ac01e1674b1ab937f488390e22f))\\n- **report:** fix f-string quotes error ([0acb5d9](https://github.com/ts-factory/bublik/commit/0acb5d937816e7790128850d344045165be1532f))\\n- **measurements:** fix dynamic chart points order ([7707006](https://github.com/ts-factory/bublik/commit/770700601d06c4a677ce0d4e4aac561edde25e58))\\n- **auth:** fix password reset ([6917826](https://github.com/ts-factory/bublik/commit/69178269221812e819be0e1fc6f3a8c9aa63301f))\\n- **management:** fix mmr sequences migration ([a9a1527](https://github.com/ts-factory/bublik/commit/a9a152746d83c0615b908d085866e4e7f829dc48))\\n- **measurements:** fix charts merging ([0659b59](https://github.com/ts-factory/bublik/commit/0659b5956911d66a27b93ea06c13a00e9dea2270))\\n- **results:** fix measurement chart building ([46817d8](https://github.com/ts-factory/bublik/commit/46817d8b4e7ebb149e720ad81c8a3211ba24a603))\\n- **report:** fix x-axis value retrieval ([7f21b95](https://github.com/ts-factory/bublik/commit/7f21b952852d1ab8b87979962b85f45a313929e7))\\n- **report:** fix chart data preparation ([28485ab](https://github.com/ts-factory/bublik/commit/28485ab0897af6e8c63948b913747821ddba07db))\\n- **report:** fix result merging by measurements ([1749bcb](https://github.com/ts-factory/bublik/commit/1749bcbd23be89584afe54da7c92b9c35d9917b3))\\n- **results:** fix measurement chart rendering without views ([c6862be](https://github.com/ts-factory/bublik/commit/c6862be8926db1052bb223d6bccce28b51448cdd))\\n- **importruns:** fix measurement results processing ([49be0d6](https://github.com/ts-factory/bublik/commit/49be0d6903f8765fec9b5bf845e7436b58d58bd4))\\n- **settings:** fix dynamic settings retrieval ([719912f](https://github.com/ts-factory/bublik/commit/719912f45720c3dbf5d69fc534f984fe7b41bee2))\\n- **management:** fix creation of invalid mmrls during migration ([f87e59f](https://github.com/ts-factory/bublik/commit/f87e59f1c0194ba94b0f2b27015977ed8eb7b1b4))\\n- **management:** fix memory overload error during migration ([fec86cd](https://github.com/ts-factory/bublik/commit/fec86cdda5757038086ea157de8e5a742696dd12))\\n- **run stats:** fix test comments addition to detailed statistics ([38c43cd](https://github.com/ts-factory/bublik/commit/38c43cd2394cbae9b61180a61c809f6d93996636))\\n\\n#### \u26a1 Performance\\n\\n- **report:** simplify points grouping ([8062a5a](https://github.com/ts-factory/bublik/commit/8062a5ac88ac4847e3b14f7bf5342666745fa44e))\\n- **management:** optimize incorrect objects deletion ([43c8682](https://github.com/ts-factory/bublik/commit/43c8682ddbc2c3196b682047be4128e7f2725534))\\n- **management:** optimize duplicate deletion ([127d72a](https://github.com/ts-factory/bublik/commit/127d72a901611a33815bfe8fb97edef62a8a0c86))\\n- **management:** optimize mmr sequences migration ([3358f3f](https://github.com/ts-factory/bublik/commit/3358f3f5d712958c93a03cf5c3656739c77b8ef0))\\n\\n#### \ud83d\ude80 New Featire\\n\\n- **management:** update reformat configs command ([637b55b](https://github.com/ts-factory/bublik/commit/637b55b4e686d8318cf43df594ecdc0d9b4c2b42))\\n- **docs(rest):** add dependencies for OpenAPI schema generation ([a0aeea0](https://github.com/ts-factory/bublik/commit/a0aeea016aba085238e91f94fce7da3cbc821e83))\\n- **management:** update the database cleanup command ([dced068](https://github.com/ts-factory/bublik/commit/dced0684bd71a825b3b8db7b094165181a91adcc))\\n\\n#### \u267b\ufe0f Code Refactoring\\n\\n- **auth:** change the source of the main config ([47a4b22](https://github.com/ts-factory/bublik/commit/47a4b22a3b928e2c1740ca20f0814311e0666ad6))\\n- **settings:** change the source of dynamic settings ([bdf03fa](https://github.com/ts-factory/bublik/commit/bdf03fa8a5efda7e8e45b566b10eced551419c11))\\n- **management(refactor):** improve reformat configs command ([2a8e737](https://github.com/ts-factory/bublik/commit/2a8e737c7c9fc16b5a39722d8b2943c27e8c4f32))\\n- **importruns:** refactor measurement results saving ([57db67c](https://github.com/ts-factory/bublik/commit/57db67c81c47d602d761eca9a3d8e24a26e40f9a))\\n- **importruns:** refactor measurement result saving ([81a2a62](https://github.com/ts-factory/bublik/commit/81a2a6245f69b4897bc66b02ef12004db6e64055))\\n- **results:** separate the plotting of different views ([d5f4671](https://github.com/ts-factory/bublik/commit/d5f46716ccf9d03441725b4a412059debc1770cf))\\n- **measurements:** unify getting of iterations mmrs ([8b34711](https://github.com/ts-factory/bublik/commit/8b3471146f9e7030b08059c7e7b14bb5e7692bd2))\\n- **measurements:** make results repr func more universal ([34082f7](https://github.com/ts-factory/bublik/commit/34082f7b07f92ef84bca0160f53391eb86571a1c))\\n- **refactor(report):** simplify the grouping by args key ([352ae56](https://github.com/ts-factory/bublik/commit/352ae5664c48e89891efb42ea1a089cca6b8ff76))\\n- **refactor(report):** update unprocessed iters processing ([c870104](https://github.com/ts-factory/bublik/commit/c870104f2e6c08f99e27e3ea48597f7eeee80a0e))\\n- **management:** ensure data integrity during mmr migration ([8e40382](https://github.com/ts-factory/bublik/commit/8e40382913085c2503fbf717810fe37c8e35a483))\\n- **measurements:** unify result merging by measurements ([8088ac9](https://github.com/ts-factory/bublik/commit/8088ac9e346f07e8eba281b609ef35575197c150))\\n- **management:** reduce cleanup transaction time and contention ([0816fd6](https://github.com/ts-factory/bublik/commit/0816fd68fb44797ca65817bf01370a4d5ac09d34))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **measurements:** fix chart subtitles ([db66571](https://github.com/ts-factory/bublik/commit/db665717fdbbf2a80149987f1efc69eb9aaf5889))\\n- **measurements:** fix incorrect naming of iteration result IDs ([fa3afc0](https://github.com/ts-factory/bublik/commit/fa3afc0b77608a61ce6149a14551547ae6276d84))\\n\\n#### \ud83e\uddf9 Cleanup\\n\\n- **requirements:** ensure consistent sorting in dependencies ([6da2665](https://github.com/ts-factory/bublik/commit/6da26655331b8e49c22bdab27124794dbefb3989))\\n- **cleanup:** add typing of class variables ([98144d6](https://github.com/ts-factory/bublik/commit/98144d69c5bd03cff99801bb8fec81725466259f))\\n- **cleanup(report):** clarify comments and remove unused logging ([3a3a24f](https://github.com/ts-factory/bublik/commit/3a3a24f7d7c7eb0d984078107b88bdadecdbad97))\\n- **management:** fix DB cleanup log formatting ([b596b59](https://github.com/ts-factory/bublik/commit/b596b59ea002a7c0c4e4ad8142fb1ce678a10183))\\n- **cleanup(measurements):** improve code quality ([24ae37a](https://github.com/ts-factory/bublik/commit/24ae37a51f9439c464ecb5a4e3a122c8e2a3874a))\\n- **cleanup:** improve measurement models maintainability ([554dbac](https://github.com/ts-factory/bublik/commit/554dbacb1e30f973400305b5c89a679aa9084aa9))\\n- **cleanup:** improve report components readability ([eae822f](https://github.com/ts-factory/bublik/commit/eae822ff9cd2af5e447f00cdb2cb04fcc1054fec))\\n- **cleanup:** improve readability of retrieved test comments ([dc25cb8](https://github.com/ts-factory/bublik/commit/dc25cb859ac0bab8228951bdcf66612683da1821))"},{"id":"release-v0.7.0","metadata":{"permalink":"/bublik-release/blog/release-v0.7.0","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-11-14-release-v0.7.0/index.mdx","source":"@site/blog/2024-11-14-release-v0.7.0/index.mdx","title":"Release v0.7.0","description":"We are excited to announce Bublik v0.7.0!","date":"2024-11-14T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":2.51,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null},{"name":"Rybchenko Natalia","title":"Bublik Backend Maintainer","url":"https://github.com/ol-nata","imageURL":"https://github.com/ol-nata.png","key":"ol-nata","page":null}],"frontMatter":{"title":"Release v0.7.0","authors":["okt-limonikas","ol-nata"],"tags":["release"],"slug":"release-v0.7.0"},"unlisted":false,"prevItem":{"title":"Release v1.0.2","permalink":"/bublik-release/blog/release-v1.0.2"},"nextItem":{"title":"Release v0.6.2","permalink":"/bublik-release/blog/release-v0.6.2"}},"content":"We are excited to announce **Bublik v0.7.0**!\\n\\nThis release brings several improvements and new features, including better pagination, enhanced configuration handling,\\nand new options for viewing run results.\\nThe log functionality has been refined, with the addition of scroll-to-top behavior.\\nWe\u2019ve also introduced a more flexible report system with detailed configuration and run information and fixed getting valid configurations, as well as incorrect links to the run source.\\n\\n\x3c!--truncate--\x3e\\n\\n## Highlights\\n\\n### Result Requirements & Artifacts\\n\\n![Result requirements](./img/run-results.png)\\n\\n### Log Verdicts & Artifacts\\n\\n![Log verdicts](./img/log-verdicts.png)\\n\\n### Report Description\\n\\n![Report description](./img/report-desc.png)\\n\\n## Admin Section\\n\\n### Update Steps\\n\\nDeployment: `./scripts/deploy --steps run_services`\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n* **report:** added link from report to log page ([d2c63cb](https://github.com/ts-factory/bublik-ui/commit/d2c63cba37d7310f8c1fbaaab458c2115d3fb0b2)), closes [#214](https://github.com/ts-factory/bublik-ui/issues/214)\\n* **report:** added run details to report ([70b0b25](https://github.com/ts-factory/bublik-ui/commit/70b0b25c4fefacf644fc112ce00ac84d7295ef88))\\n* **run:** [results] added artifacts and requirements to results ([a00d9bc](https://github.com/ts-factory/bublik-ui/commit/a00d9bc72e5ec5d5aaa0efb51d521c687157311b))\\n* **run:** added endpoint to get verdicts and artifacts for iteration ([551352d](https://github.com/ts-factory/bublik-ui/commit/551352d79050a3c1b74d7278a628181325f392c2))\\n\\n#### \ud83d\udc85 Polish\\n\\n* **log:** [details] removed minimum height for details block ([e0c4fd9](https://github.com/ts-factory/bublik-ui/commit/e0c4fd931800bce66dd06de51331727bbeadee35))\\n* **run:** [details] removed minimum height for details block ([3d76aac](https://github.com/ts-factory/bublik-ui/commit/3d76aac5542de1072b0921a9115bf4adfc662165))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n* **config:** [update] added handling for error when config with same name exists ([00296f8](https://github.com/ts-factory/bublik-ui/commit/00296f89120e70c543cc160c7991b05b503ee9f5))\\n* **log:** added scroll to top on page change ([9b479e8](https://github.com/ts-factory/bublik-ui/commit/9b479e835893f551fda5ea1f1fa39e99caa580a3))\\n* **run, log:** disable source link on URL retrieval failure ([ed3c420](https://github.com/ts-factory/bublik-ui/commit/ed3c420619c4dcb77ddf53d9edf8cc0cc128d1a8)), closes [#216](https://github.com/ts-factory/bublik-ui/issues/216)\\n* **run:** [results] added handling for results in progress ([932773a](https://github.com/ts-factory/bublik-ui/commit/932773aafe80b2ce9a9a18f507f12a9b1770b785))\\n\\n#### \u267b Code Refactoring\\n\\n* **config:** added name field to update config form ([5148e56](https://github.com/ts-factory/bublik-ui/commit/5148e5677be5c80d4bce5d3072e27553adeed8f4))\\n* **config:** adjusted logic for activating/deactivating config ([673dc0c](https://github.com/ts-factory/bublik-ui/commit/673dc0c7a64c9e8eb464fea1aaacf3a63471bc5d))\\n* **config:** adjusted types to allow renaming configs ([b26fd97](https://github.com/ts-factory/bublik-ui/commit/b26fd97456ae69eb5a6a4ac74e513cd9928967ae))\\n* **log:** [new-bug] try to get configuration from `special_categories` ([49875f9](https://github.com/ts-factory/bublik-ui/commit/49875f9eab060797269d29228c9ad97755153285))\\n* **log:** get artifacts and verdicts from API and merge them into log ([fc38cca](https://github.com/ts-factory/bublik-ui/commit/fc38ccaa9ee68d7be25ffeef815ea6c70954a9e6))\\n* **log:** made pagination look the same top and bottom ([67374a9](https://github.com/ts-factory/bublik-ui/commit/67374a9b0c81d6a1d1023de824152793d86d354b))\\n* **report:** added report description frame with config and warnings ([4421048](https://github.com/ts-factory/bublik-ui/commit/442104867afc7f5af522b4c80b7f3e33bfd9df29))\\n\\n#### \ud83d\udd27 Continuous Integration | CI\\n\\n* **build:** added check to ensure code is buildable ([86166a5](https://github.com/ts-factory/bublik-ui/commit/86166a52b25a8fd76eab83f0e7b1f1326a3aa9b6))\\n\\n#### \ud83d\udce6 Chores\\n\\n* **config:** adjusted alert dialog description for activation of the config ([9b69d74](https://github.com/ts-factory/bublik-ui/commit/9b69d74ecd05529cc3458fe8ee585f95e2a05c2f))\\n* **config:** removed redundant endpoint ([b810389](https://github.com/ts-factory/bublik-ui/commit/b810389f258d431abc2f8274ade5bc045da9206d))\\n* **log:** removed redundant prop ([6bd37aa](https://github.com/ts-factory/bublik-ui/commit/6bd37aacb340a6c87c5f2d6ec23837119d354957))\\n* **log:** removed redundant type ([48d17a5](https://github.com/ts-factory/bublik-ui/commit/48d17a53c41140881bb593616a7755736bf8b970))\\n* **log:** simplified logic for redirect to legacy ([e390fe7](https://github.com/ts-factory/bublik-ui/commit/e390fe72920a267a2dd4af132c7a79a4f93752ec))\\n* **run:** [results] renamed badly named variables ([724a688](https://github.com/ts-factory/bublik-ui/commit/724a6884044cc8f2599370dbcf8d9d3651176b53))\\n\\n### Backend\\n\\n#### \ud83d\udc1b Bug Fix\\n- **bugfix:** fix passing arguments in response ([52dbe74](https://github.com/ts-factory/bublik/commit/52dbe74cc168c82095f4cf99157832fd48d6d49e))\\n- **urls:** fix run source link building ([a8a406e](https://github.com/ts-factory/bublik/commit/a8a406e2f4b99069b4d0ed939055ba22b7d23bd7))\\n- **report:** fix getting the applicable configs ([6b45fcc](https://github.com/ts-factory/bublik/commit/6b45fcc9a8c7a3c7af5d09455c8208ccc85553c3))\\n\\n#### \ud83d\ude80 New Feature\\n- **results:** add endpoint to get result verdicts and artifacts ([beabf15](https://github.com/ts-factory/bublik/commit/beabf15767af4b068d7e84deb1e4467fdea641de))\\n- **config:** make it possible to rename configs ([375b701](https://github.com/ts-factory/bublik/commit/375b701a493d0fc1dce4f7db245ca8f53cea5046))\\n- **importruns:** import information about requirements ([afe99a2](https://github.com/ts-factory/bublik/commit/afe99a2310360a3fa7559fab119c4a2b55048e27))\\n- **importruns:** store test iter reqs in the database ([1fb0fc9](https://github.com/ts-factory/bublik/commit/1fb0fc938d704e67f46ff00f91975d6890734af9))\\n- **run stats:** make result details more informative ([b418ea9](https://github.com/ts-factory/bublik/commit/b418ea996be429f707349b904eace16d0b87b0b9))\\n- **run stats:** make result details more informative ([74a66c6](https://github.com/ts-factory/bublik/commit/74a66c6d3c4a9323e3a103b26c26d593e2b933b0))\\n- **report:** update the data to display ([67cfc96](https://github.com/ts-factory/bublik/commit/67cfc967a0029c44ddf668b1f8ccede1e1c8a0ba))\\n\\n#### \ud83d\udce6 Chores\\n- **config:** unify configuration updates ([945f0d8](https://github.com/ts-factory/bublik/commit/945f0d8616eef8a01cc87280ae8b93788308a655))\\n\\n#### \u267b Code Refactoring\\n- **config:** refactor retrieval of all versions ([7bcfd73](https://github.com/ts-factory/bublik/commit/7bcfd733ad882d2cd40ab9f2b476d2c94cde04fa))\\n- **config:** refactor activation ([ff3d394](https://github.com/ts-factory/bublik/commit/ff3d394acca2ac74a1df3f3f03a3ff6201dbf5b6))\\n- **config:** refactor deletion ([5345b00](https://github.com/ts-factory/bublik/commit/5345b00ef6d35088cfbbb62bea5a8ee02b91d471))\\n- **cleanup:** remove unused class import ([dfc9ff2](https://github.com/ts-factory/bublik/commit/dfc9ff2cb49ce1a434e4a51e8e02122482957dc0))"},{"id":"release-v0.6.2","metadata":{"permalink":"/bublik-release/blog/release-v0.6.2","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-10-30-release-v0.6.2/index.mdx","source":"@site/blog/2024-10-30-release-v0.6.2/index.mdx","title":"Release v0.6.2","description":"We are happy to announce Bublik v0.6.2.","date":"2024-10-30T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":2.27,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null},{"name":"Rybchenko Natalia","title":"Bublik Backend Maintainer","url":"https://github.com/ol-nata","imageURL":"https://github.com/ol-nata.png","key":"ol-nata","page":null}],"frontMatter":{"title":"Release v0.6.2","authors":["okt-limonikas","ol-nata"],"tags":["release"],"slug":"release-v0.6.2"},"unlisted":false,"prevItem":{"title":"Release v0.7.0","permalink":"/bublik-release/blog/release-v0.7.0"},"nextItem":{"title":"Release v0.5.0","permalink":"/bublik-release/blog/release-v0.5.0"}},"content":"We are happy to announce **Bublik v0.6.2**.\\n\\nThis release introduces an experimental multiple runs stats page, enabling users to view multiple runs on the same page. We have also expanded the headings in the reports and made them more understandable.\\n\\n**Highlights**\\n- Multiple Runs Page: Explore and multiple merged results on a single page.\\n- Reports Button: Access reports directly from the log page.\\n- Log Preview: Redesigned log preview with a new bug button for easier access.\\n\\n\x3c!--truncate--\x3e\\n\\n## Highlights\\n\\n### Multiple Runs Page\\n\\n:::info\\n  This is experimental feature\\n:::\\n\\n#### Selection\\n\\n![Runs selection](./img/runs-multiple.png)\\n\\n####  Page\\n\\n![Runs merged page](./img/multiple-page.png)\\n\\n### Reports Button\\n\\n![Log button](./img/log-reports-button.png)\\n\\n### Log Preview\\n\\nWe\'ve made small redesign adjustment and also added new bug button to preview\\n\\n![Log Preview](./img/log-preview.png)\\n\\n### New Bug\\n\\nSmall redesign to match new log preview style\\n\\n![New Bug Drawer](./img/new-bug-drawer.png)\\n\\n### Updated Report Headers\\n\\n![New Headers](./img/headers.png)\\n\\n## Admin Section\\n\\n### Update Steps\\n\\nDeployment: `./scripts/deploy --steps run_services`\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n* **log,run:** added new bug button to log preview ([f2a37ca](https://github.com/ts-factory/bublik-ui/commit/f2a37cae13f1848f95bdd9030e79142379a169ea))\\n* **log:** added link to reports from log page ([5227387](https://github.com/ts-factory/bublik-ui/commit/52273874e2ed12d04d71848e78fea280a053a1cb)), closes [#185](https://github.com/ts-factory/bublik-ui/issues/185)\\n* **run:** [multiple] added endpoint for merging multiple runs ([73902e5](https://github.com/ts-factory/bublik-ui/commit/73902e58e613f6affb409e3a52b7e56991cbb04b))\\n* **run:** [result-table] added prop to show link to result run ([7950f3c](https://github.com/ts-factory/bublik-ui/commit/7950f3cc748d9b241010ceb242e88871767563f8))\\n* **run:** added initial multiple runs page ([91bee3d](https://github.com/ts-factory/bublik-ui/commit/91bee3d88d06e139c3eadb966de35d09c0365bdf))\\n* **run:** added link to multiple run page from runs selection popover ([de98aea](https://github.com/ts-factory/bublik-ui/commit/de98aeaa64cfae42fea6c728913a4e172005ab16))\\n* **run:** added link to multiple runs in sidebar ([70c983e](https://github.com/ts-factory/bublik-ui/commit/70c983e558a36267093490078a55e41bb2c37103))\\n\\n#### \ud83d\udc85 Polish\\n\\n* **log:** [new-bug] made new bug appear as drawer content from right ([10b034f](https://github.com/ts-factory/bublik-ui/commit/10b034f44679a1e23be01f6394be9637cd382915))\\n* **run:** [details] removed unnecessary padding from list label ([94a7017](https://github.com/ts-factory/bublik-ui/commit/94a70173683f052f13b74b764555d79105059e6f))\\n* **run:** [log] show log preview as drawer from right side ([15cee82](https://github.com/ts-factory/bublik-ui/commit/15cee823ecf3ec497a13710a202280cb7b24d7d5))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n* **log:** [new-bug] added test path for generated `CMD` ([bf03de0](https://github.com/ts-factory/bublik-ui/commit/bf03de0118d2b6d674a496aa64c0eee27cff6719)), closes [#173](https://github.com/ts-factory/bublik-ui/issues/173)\\n* **run:** fixed run compromise status invalidation for runs/dashboard pages ([64d0a71](https://github.com/ts-factory/bublik-ui/commit/64d0a71fb7789a0852dec32968a53521bd0a8633))\\n* **runs:** [charts] fixed clicking on bar plot not redirecting to run ([6969fc3](https://github.com/ts-factory/bublik-ui/commit/6969fc3a350e555c2b2fb2efe73cf06b606cd02c))\\n\\n#### \u267b Code Refactoring\\n\\n* **log:** [new-bug] added function to get new bug props to remove boilerplate ([be5a89f](https://github.com/ts-factory/bublik-ui/commit/be5a89fcf4d192247ec7c2d308e78f5ed7be063d))\\n* **log:** [new-bug] simplified log-feature component logic ([1763d4f](https://github.com/ts-factory/bublik-ui/commit/1763d4f75d819dfe065d4ca06fd224b1d202e16f))\\n* **run:** [result-table] added support for merged results ([b358be9](https://github.com/ts-factory/bublik-ui/commit/b358be99fe7f02da78be2ec84e75e1260cb5cae5))\\n* **run:** added support for merged runs in run table ([36f7389](https://github.com/ts-factory/bublik-ui/commit/36f7389166731820bded8f8b7b53c2bee3b455db))\\n* **run:** adjusted run tab title generation for multiple runs ([d12c8c1](https://github.com/ts-factory/bublik-ui/commit/d12c8c1f45aa2db2f40674ccf358081f574fef68))\\n* **run:** sort results by iteration id ([d9fc3d1](https://github.com/ts-factory/bublik-ui/commit/d9fc3d16db2923908b9700c788cdc84c00698bd5))\\n\\n#### \ud83d\udce6 Chores\\n\\n* **log:** [new-bug] fixed typo for successful copy message ([30bbc34](https://github.com/ts-factory/bublik-ui/commit/30bbc3421a4b838020581247fd6cd087f43783f5))\\n* **report:** fixed formatting ([6271f19](https://github.com/ts-factory/bublik-ui/commit/6271f19ac205e6579551a2e72ecc79f507f7ebfc))\\n\\n### Backend\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n* **importruns:** fix iteration date parsing ([14c983e](https://github.com/ts-factory/bublik/commit/14c983e61bd72e1ac789ff47aef1ba40381872be))\\n\\n#### \ud83d\udc85 Polish\\n\\n* **report:** make iteration headers clearer ([9fd1b82](https://github.com/ts-factory/bublik/commit/9fd1b820fd7a28769b1c68dadf9a7c35a4080b84))\\n* **report:** make y-axis labels more informative ([969ce93](https://github.com/ts-factory/bublik/commit/969ce9365ddae8a7ea3669d123886f01b864dd11))\\n* **report:** make measurement chart label more informative ([475553d](https://github.com/ts-factory/bublik/commit/475553d111b8c38396f79516ff32b459b7858120))\\n\\n#### \u267b Code Refactoring\\n\\n* **cleanup:** fix typo ([15d640d](https://github.com/ts-factory/bublik/commit/15d640d659f36a3dea014487e92cf1ee16225bd2))\\n* **cleanup:** apply linter to report components ([1da72cb](https://github.com/ts-factory/bublik/commit/1da72cb2c015a00c951c42062c0ec7912a424b93))"},{"id":"release-v0.5.0","metadata":{"permalink":"/bublik-release/blog/release-v0.5.0","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-10-16-release-v0.5.0/index.mdx","source":"@site/blog/2024-10-16-release-v0.5.0/index.mdx","title":"Release v0.5.0","description":"We are happy to announce Bublik v0.5.0.","date":"2024-10-16T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":2.525,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null},{"name":"Rybchenko Natalia","title":"Bublik Backend Maintainer","url":"https://github.com/ol-nata","imageURL":"https://github.com/ol-nata.png","key":"ol-nata","page":null}],"frontMatter":{"title":"Release v0.5.0","authors":["okt-limonikas","ol-nata"],"tags":["release"],"slug":"release-v0.5.0"},"unlisted":false,"prevItem":{"title":"Release v0.6.2","permalink":"/bublik-release/blog/release-v0.6.2"},"nextItem":{"title":"Release v0.4.3","permalink":"/bublik-release/blog/release-v0.4.3"}},"content":"import video from \'./video/output.mp4\';\\nimport Admonition from \'@theme/Admonition\';\\n\\nWe are happy to announce **Bublik v0.5.0**.\\n\\nIn this release we\'ve added **sticky stacked headers** for reports and fixed some bugs for configs also added config font size settings. We also made the report record headers more readable, made the x-axis and sequence group argument labels configurable, and made it possible to change the order of the dashboard columns. For administrators, added a command to reformat configurations.\\n\\n\x3c!--truncate--\x3e\\n\\n## Highlights\\n\\n### Sticky Stacked Headers\\n\\n<video controls width=\\"100%\\" height=\\"100%\\">\\n  <source src={video} />\\n</video>\\n\\n### Small UI Improvements\\n\\n![Small UI Improvements](./img/reports.png)\\n\\n### Config Font Size\\n\\n![Font Size](./img/font-size.png)\\n\\n### Config Exists\\n\\n![Config Exists](./img/exists_config.png)\\n\\n### Updated Record Config Header\\n\\n![Config Header](./img/report-label.png)\\n\\n### Change Dashboard Headers Order\\n\\n![Change Dashboard Headers Order](./img/config-header.png)\\n\\n### Add Report Argument Labels\\n\\n![Args](./img/seq.png)\\n\\n## Admin Section\\n\\n### Update Steps\\n\\nDeployment: `./scripts/deploy --steps django_settings run_services`\\n\\n<Admonition type=\\"danger\\" icon=\\"\ud83d\udca1\\" title=\\"Upgrade\\">\\n  When upgrading to this version, you need to reformat all configurations.{\' \'}\\n  <br />\\n  <br />\\n  <b>Follow these steps:</b>\\n  <ul>\\n    <li>\\n      Activate the virtual environment: <code>source .env/bin/activate</code>\\n    </li>\\n    <li>\\n      Call the configuration reformatting command:{\' \'}\\n      <code>python manage.py reformat_configs</code>\\n    </li>\\n  </ul>\\n</Admonition>\\n\\n### Important Info\\n\\n:::warning\\n\\nConfigurations whose automatic formatting has failed will not be supported by Bublik. Either reformat them manually or delete.\\n\\n:::\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **configs:** [editor] added setting to change font size ([53ef50e](https://github.com/ts-factory/bublik-ui/commit/53ef50e029270879fc73d9010998d17b51e0af06)), closes [#145](https://github.com/ts-factory/bublik-ui/issues/145)\\n- **configs:** added shortcut to trigger autocomplete in editor `ctrl+\\\\` ([e5f6078](https://github.com/ts-factory/bublik-ui/commit/e5f6078a60f0b6ee38e1e36bd7da3a634e058ade)), closes [#144](https://github.com/ts-factory/bublik-ui/issues/144)\\n- **report:** added button to copy link for currently open report ([83f5c63](https://github.com/ts-factory/bublik-ui/commit/83f5c6337f21a48d515c57959d926205b7c45c8a)), closes [#152](https://github.com/ts-factory/bublik-ui/issues/152)\\n- **report:** added link to config used for generation current report ([3f606cc](https://github.com/ts-factory/bublik-ui/commit/3f606cc063c7305fdb9648542781d3e407c86cb3)), closes [#151](https://github.com/ts-factory/bublik-ui/issues/151)\\n- **report:** added sticky-stacked headers for all levels ([f0ce3af](https://github.com/ts-factory/bublik-ui/commit/f0ce3af9ac834a547591ddcdaeec76eed27145be)), closes [#147](https://github.com/ts-factory/bublik-ui/issues/147)\\n\\n#### \ud83d\udc85 Polish\\n\\n- **history:** [plots] moved links for plot point to modal header ([38d8221](https://github.com/ts-factory/bublik-ui/commit/38d822197ba8cc2c0bc751214680f14a0de9c9e2))\\n- **log:** fixed button for log filters being shown on top of the new bug modal ([8fd958b](https://github.com/ts-factory/bublik-ui/commit/8fd958bd10515163c8eb9d2c6acb76d05b0a74ed))\\n- **report:** fixed missing border in case `multiple_sequences` is `false` ([46d2b14](https://github.com/ts-factory/bublik-ui/commit/46d2b14bb6934787cf16913bd7af56fe42f9559a))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **configs:** added modal to show \\"navigate to existing config\\" if it exists ([4639f21](https://github.com/ts-factory/bublik-ui/commit/4639f2127d6963406cb54d134c626b5c43bd3ad4))\\n- **configs:** allowed partial updates for config ([7b8150d](https://github.com/ts-factory/bublik-ui/commit/7b8150d76f9724b8191a76e99487eb27ba42dd9e))\\n- **log,run:** fixed parameters incorrectly cutting off \\"=\\" ([b6d2032](https://github.com/ts-factory/bublik-ui/commit/b6d2032255ae3c8918f93891d0d055a95d674583)), closes [#137](https://github.com/ts-factory/bublik-ui/issues/137)\\n\\n#### \u267b Code Refactoring\\n\\n- **build:** adjusted release config to sort sections ([9d1affc](https://github.com/ts-factory/bublik-ui/commit/9d1affc83e4e5ba6374c227db3da7c50bf62f6bc)), closes [#138](https://github.com/ts-factory/bublik-ui/issues/138)\\n- **configs:** extracted all components to improve readability ([df9cbc3](https://github.com/ts-factory/bublik-ui/commit/df9cbc3c7b92d04d5c37d69dffdcfaac2555d220))\\n\\n#### \ud83d\udce6 Chores\\n\\n- **sidebar:** moved history and measurements links to the bottom ([b480074](https://github.com/ts-factory/bublik-ui/commit/b48007433f5679d642eab3884abb47d3d4f3315d)), closes [#139](https://github.com/ts-factory/bublik-ui/issues/139)\\n\\n### Backend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **management:** add ability to reformat configs ([38b8435](https://github.com/ts-factory/bublik/commit/38b843519a76a9e8384b02270134cd6422f35e8b))\\n- **management:** update reformat configs command ([000c27f](https://github.com/ts-factory/bublik/commit/000c27f0d5b8a26fff9a4fad669fa257cb6dfb2d))\\n- **dashboard:** make it possible to sort columns ([e837f0e](https://github.com/ts-factory/bublik/commit/e837f0ebbb9b04450f4d79c7c8ffc35a5950e1db))\\n- **management:** update reformat configs command ([0a9b06e](https://github.com/ts-factory/bublik/commit/0a9b06e19caae735c8228a089027356386adda3e))\\n- **config:** format the main config during migration ([74f10a7](https://github.com/ts-factory/bublik/commit/74f10a7110fb80ef713b0343a1cb005204a7dea3))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **report:** make measurement chart label more readable ([546ad90](https://github.com/ts-factory/bublik/commit/546ad9053ba2465bbef9c7d6c6b8b2870e25a9a7))\\n- **report:** make headers more readable ([063a325](https://github.com/ts-factory/bublik/commit/063a325b39c9675c3c03018bf2d6c9d6aaed5729))\\n\\n#### \ud83d\udce6 Chores\\n\\n- **settings:** increase the access token lifetime ([4dbf1b0](https://github.com/ts-factory/bublik/commit/4dbf1b0bbfb3978ba59193470989d3ca32e02eee))\\n\\n#### \u267b Code Refactoring\\n\\n- **cleanup:** apply linter to report services ([6610fac](https://github.com/ts-factory/bublik/commit/6610fac7223627cae4863847fa3c696c6173684a))\\n- **report:** apply linter to report components ([06ba32c](https://github.com/ts-factory/bublik/commit/06ba32c087974e61baab2c29d89fe871d32c37d5))\\n- **config:** refactor the main config migration ([0dc8df5](https://github.com/ts-factory/bublik/commit/0dc8df50390f15857c39b7b79d8195d490bce88f))"},{"id":"release-v0.4.3","metadata":{"permalink":"/bublik-release/blog/release-v0.4.3","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-10-04-release-v0.4.2/index.mdx","source":"@site/blog/2024-10-04-release-v0.4.2/index.mdx","title":"Release v0.4.3","description":"We are happy to announce Bublik v0.4.3.","date":"2024-10-04T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":2.52,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null},{"name":"Rybchenko Natalia","title":"Bublik Backend Maintainer","url":"https://github.com/ol-nata","imageURL":"https://github.com/ol-nata.png","key":"ol-nata","page":null}],"frontMatter":{"title":"Release v0.4.3","authors":["okt-limonikas","ol-nata"],"tags":["release"],"slug":"release-v0.4.3"},"unlisted":false,"prevItem":{"title":"Release v0.5.0","permalink":"/bublik-release/blog/release-v0.5.0"},"nextItem":{"title":"Release v0.3.9","permalink":"/bublik-release/blog/release-v0.3.9"}},"content":"We are happy to announce **Bublik v0.4.3**.\\n\\nIn this we release we\'ve added **config management UI** and added **table of contents** for reports\\n\\n\x3c!--truncate--\x3e\\n\\n### Key Features\\n\\n- **Config Management UI:**\\n  - Introduced UI page for managing configurations, providing more flexibility in managing settings.\\n- **Report Enhancements:**\\n  - Added a Table of Contents to the report view for easier navigation.\\n\\n### Improvements and Fixes\\n\\n- **UI Polish:**\\n\\n  - Improved readability of alert dialogs.\\n  - Fixed double borders in report labels, enhancing visual clarity.\\n\\n### Code Refactoring and Chores\\n\\nWe hope these changes improve your experience, and we look forward to your feedback!\\n\\n## Highlights\\n\\n:::info\\nConfiguration management is available only to administrators.\\n:::\\n\\n### Config manager\\n\\n![Configs](./img/config.png)\\n\\n### Inactive Configs\\n\\n![Inactive Configs](./img/inactive.png)\\n\\n### New Config Dropdown Menu\\n\\n![New Config Dropdown Menu](./img/new-config-button.png)\\n\\n### New Config Modal\\n\\n![New Config Modal](./img/new-config-modal.png)\\n\\n### Update Config\\n\\n![Update Config Modal](./img/update-modal.png)\\n\\n### Versions Modal\\n\\n![Versions Modal](./img/versions-modal.png)\\n\\n### Report Table Of Contents\\n\\n![Table Of Contents](./img/table.png)\\n\\n## Admin Section\\n\\n### Update Steps\\n\\nDeployment: `./scripts/deploy --steps pip_requirements django_settings migrate_db run_services`\\n\\n:::danger\\nWhen upgrading to this version, you need to migrate the main configuration of the Bublik instance to the database:\\n\\n![The Main Config Migration](./img/migrate-config.png)\\n:::\\n\\nIf you don\'t have a Bublik account, create one by the following steps:\\n\\n1. Activate the virtual environment: `source .env/bin/activate`\\n2. Initiate the creation of a superuser: `python manage.py createsuperuser`\\n\\n### Important Info\\n\\n:::warning\\nDjango\'s configurable settings still use *per_conf.py*. This will be fixed soon.\\n:::\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **configs:** added API endpoints for config management ([1aa6673](https://github.com/okt-limonikas/bublik/commit/1aa6673326283f6dfebd28d11fecf29364829db8))\\n- **configs:** added config management page ([613ce46](https://github.com/okt-limonikas/bublik/commit/613ce4638dd1a096a8266881f801dab56218ed9e))\\n- **report:** added table of contents to report ([7667a0e](https://github.com/okt-limonikas/bublik/commit/7667a0ec0066fc300b48aae20b4041199f4a5667))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **report:** fixed double borders for report labels ([d4fd924](https://github.com/okt-limonikas/bublik/commit/d4fd924860e87fd7d946de0d4185abc2b8d3be5d))\\n- **ui:** [alert-dialog] improve readability for dialog ([ce9f12f](https://github.com/okt-limonikas/bublik/commit/ce9f12f0e70271a45e7e5810025a8d8560a1c20e))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **build:** correct proxying to derive API path from URL_PREFIX ([1f62c82](https://github.com/okt-limonikas/bublik/commit/1f62c82bf36ca1d058b63b940782da39ae2b5759))\\n- **build:** skip package scripts to optimize dev build ([0f12745](https://github.com/okt-limonikas/bublik/commit/0f1274563c1742f27f3e870e5c251b9fd5e92a71))\\n- **report:** fixed incorrect scrolling on mount ([f4b284b](https://github.com/okt-limonikas/bublik/commit/f4b284b25300e5fb9cfd896efe2cea9b9774b2b3))\\n\\n#### \u267b Code Refactoring\\n\\n- **run:** [reports] adjusted types and components for config changes ([b3eb33a](https://github.com/okt-limonikas/bublik/commit/b3eb33a4f87f238c0aa79016b3b4b951f85e4c85))\\n- **ui:** [card-header] allow passing react node as label ([5aac339](https://github.com/okt-limonikas/bublik/commit/5aac3390e0b519189b7bf2757721979730892f58))\\n\\n#### \ud83d\udce6 Chores\\n\\n- added react-monaco-editor dependency ([b5e858a](https://github.com/okt-limonikas/bublik/commit/b5e858a7e462b1ad75c51825f06549d914c02321))\\n- **report:** updated components for new type changes ([f05977c](https://github.com/okt-limonikas/bublik/commit/f05977c327ebd97801310f581dd9ac43785d875f))\\n- **types:** updated report types to API changes ([34ed7e9](https://github.com/okt-limonikas/bublik/commit/34ed7e99defa4e7472e6f6fa2732dc828c33f45b))\\n\\n### Backend\\n\\n#### \ud83d\udc1b Bug Fix\\n- **history:** fix filtering by expressions ([649bca0](https://github.com/ts-factory/bublik/commit/649bca067862421d70091b4321a8481ca22b9a2b))\\n- **config:** fix the main configuration JSON schema ([38ef39e](https://github.com/ts-factory/bublik/commit/38ef39e3ce4b144c387c1db9f0184befe80b4721))\\n- **config:** fix the main config migration ([d60bc81](https://github.com/ts-factory/bublik/commit/d60bc81d5b5dd2d74fea177eafffc8637ab15de3))\\n- **report:** fix unprocessed iters handling ([45ebf10](https://github.com/ts-factory/bublik/commit/45ebf104568f3cfaf7426f0a885596e1e252d0da))\\n\\n#### \ud83d\udcbe DB Changes\\n- **models:** add model to store configurations ([74f56d2](https://github.com/ts-factory/bublik/commit/74f56d22cda53da219a07e118d9ac11ff8dd8107))\\n\\n#### \ud83d\ude80 New Feature\\n- **config:** add data validation and preprocessing ([b178cd1](https://github.com/ts-factory/bublik/commit/b178cd1811712a70e189aaf2d221ab32d8d57c39))\\n- **config:** add API for management ([77da58c](https://github.com/ts-factory/bublik/commit/77da58c562c07b1dbacd1a2ba090658fe10fb526))\\n- **per_conf:** change the source of attributes getting ([2556ec0](https://github.com/ts-factory/bublik/commit/2556ec0929a98d3fc0eae3e617396ee2f897e8ba))\\n- **report:** change the source of config getting ([d714815](https://github.com/ts-factory/bublik/commit/d714815aff12e53c5aac2174677d2014dc100d1e))\\n\\n#### \ud83d\udce6 Chores\\n- **report:** update report content structure ([4abe460](https://github.com/ts-factory/bublik/commit/4abe4604f69d0c186a649b3873a4564395f4f89c))\\n- **report:** make reports more flexible ([51a5a48](https://github.com/ts-factory/bublik/commit/51a5a48f7426ea9d556c2b315ccd56ca6298b8e2))\\n- **report:** make record title more informative ([1ed43e4](https://github.com/ts-factory/bublik/commit/1ed43e48f7017ca6ef238746c27d2f046589ae28))\\n- **cleanup:** fix report function documentation ([a8b80d2](https://github.com/ts-factory/bublik/commit/a8b80d219c9dbaa116d258ffad2eac7ffec2db29))\\n- **config:** refactor JSON schema getting ([9e04f2a](https://github.com/ts-factory/bublik/commit/9e04f2a741785c1fc5b6fc976bc3f35694a8a620))\\n\\n```"},{"id":"release-v0.3.9","metadata":{"permalink":"/bublik-release/blog/release-v0.3.9","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-09-24-release-v0.3.9/index.mdx","source":"@site/blog/2024-09-24-release-v0.3.9/index.mdx","title":"Release v0.3.9","description":"We are happy to announce Bublik v0.3.9.","date":"2024-09-24T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":2.72,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null}],"frontMatter":{"title":"Release v0.3.9","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.9"},"unlisted":false,"prevItem":{"title":"Release v0.4.3","permalink":"/bublik-release/blog/release-v0.4.3"},"nextItem":{"title":"Release v0.3.7","permalink":"/bublik-release/blog/release-v0.3.7"}},"content":"We are happy to announce **Bublik v0.3.9**.\\n\\nIn this release we\'ve added UI for creating and editing notes for tests on the run page. We\'ve also fixed some small styling issues on the run page and also fixed errors and improved the information content of the reports page.\\n\\n\x3c!--truncate--\x3e\\n\\n### Key Features:\\n\\n1. **UI for Creating and Editing Test Notes**:  \\n   Adds an interface for creating and editing test run notes, improving documentation and tracking.\\n2. **Borders for Notes and Objectives**:  \\n   Enhances the visual clarity of the `Notes` and `Objective` columns by adding borders.\\n3. **More Informative Report Page**:  \\n   Increasing the information content of record headers and table headers.\\n4. **More Flexible Report Configuration Structure**:  \\n   Allows partial filtering of records by arguments.\\n\\n### Fixes and Minor Enhancements:\\n\\n1. **Sorting UI Adjustments**:  \\n   Resolves an issue where sorting controls appeared on non-sortable columns.\\n2. **Number Alignment Fix**:  \\n   Corrects the alignment of \\"0\\" in table columns.\\n3. **Some Report Fixes**:  \\n   Fix filtering by measurements and not processed points handling.\\n\\n## Highlights\\n\\n### Table with notes\\n\\n![Table](./img/table.png)\\n\\n### Editing Note\\n\\n![Edit](./img/edit.png)\\n\\n:::tip\\nBy default, comment management is available only to administrators. To remove this restriction, you need to add `NOT_PERMISSION_REQUIRED_ACTIONS = [\'manage_test_comments\']` to your project configuration (*per_conf.py*).\\n:::\\n\\n### All Notes Popover\\n\\n![all](./img/all.png)\\n\\n### Editing Note Inside Popover\\n\\n![edit-all](./img/edit-all.png)\\n\\n### More Informative Report Records Headers\\n\\n![Report](./img/report_headers.png)\\n\\n### \\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udce6 Chores\\n\\n- **runs:** [table] removed unnecessary import ([c3dc7ca](https://github.com/ts-factory/bublik-ui/commit/c3dc7ca92d142458fb8f29635aea5d8733675595))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **run:** [table] display sorting ui only for sortable columns ([97827d0](https://github.com/ts-factory/bublik-ui/commit/97827d09cd4e1c6ad6f004ed97b8c028d0d36aa2))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **run:** [table] added UI for creating/editing test notes ([6e3b470](https://github.com/ts-factory/bublik-ui/commit/6e3b470711d9a4955e791b59c098b83f7a327ff5))\\n- **run:** added endpoints to handle note CRUD for test ([6e34438](https://github.com/ts-factory/bublik-ui/commit/6e34438bd09e0ce4f9eb0fe0b2e6789fabdf6f9e))\\n- **ui:** [button] added variant for destruction-secondary styles ([8c75174](https://github.com/ts-factory/bublik-ui/commit/8c7517476ddba8fb011c2cb2dffab2244b562561))\\n- **ui:** added file plus icon ([1e5eae0](https://github.com/ts-factory/bublik-ui/commit/1e5eae03ef81b028db446971eaac43dab8c2a973))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **run:** [table] added borders for and columns ([f5d94ee](https://github.com/ts-factory/bublik-ui/commit/f5d94ee075784bf55eb3a506573935c6321de29b))\\n- **run:** [table] fixed number alignment for 0 ([23023e6](https://github.com/ts-factory/bublik-ui/commit/23023e640533952a85ec703df8a670f3cdd848ca)), closes [#130](https://github.com/ts-factory/bublik-ui/issues/130)\\n- **run:** [table] lower opacity to indicate pending state ([dfa74f9](https://github.com/ts-factory/bublik-ui/commit/dfa74f923d9bfc41af8bc5308c6607de93db2a2e))\\n- **ui:** [alert] added dialog overlay by default to alert dialog ([e7e860e](https://github.com/ts-factory/bublik-ui/commit/e7e860e6a3ec6399c25d235225aad563fd84050e))\\n\\n### Backend\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **report:** fix filtering by measurements ([4bde173](https://github.com/ts-factory/bublik/commit/4bde17356cd2a34d2adff026423f68335a7335a0))\\n- **report:** fix format of filtering result by measurement ([202e6c8](https://github.com/ts-factory/bublik/commit/202e6c85732defecb6dca1c92da1a24e6ed34483))\\n- **report:** fix display of sequence group arg of not processed points ([098d7b8](https://github.com/ts-factory/bublik/commit/098d7b8fb678c4e7362f2d180620b7f005a59b43))\\n- **report:** fix not processed points handling ([a52d376](https://github.com/ts-factory/bublik/commit/a52d3763b89d1bff96b23542b5b6e99b22d5fa38))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **auth:** add action permission \u0441heck function ([f564599](https://github.com/ts-factory/bublik/commit/f5645997d5d5eb8820e4ad9398f764893a4c2ac1))\\n- **test comments:** add data validation and preprocessing ([19ef66e](https://github.com/ts-factory/bublik/commit/19ef66e0bf82d78d196260495fcfc9bea4be7e52))\\n- **test comments:** add API for management ([8aeea91](https://github.com/ts-factory/bublik/commit/8aeea91e47cd789fb058807d7e2c0051ae83031b))\\n- **run stats:** make detailed stats more informative ([9e7d7fb](https://github.com/ts-factory/bublik/commit/9e7d7fbf5d6203d3359a682406a51ca8aff9563a))\\n\\n#### \ud83d\udcbe DB Changes\\n\\n- **test comments:** add tests and metas relationship model ([e9bc750](https://github.com/ts-factory/bublik/commit/e9bc7506d23ff227cd36c248b0f423314c68442f))\\n- **models:** fix help text of Meta model type field ([cabbf1b](https://github.com/ts-factory/bublik/commit/cabbf1b19d5e58cc8ac20dcab8e37a4baed408b8))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **report:** make displayed error message more informative ([a8c40a0](https://github.com/ts-factory/bublik/commit/a8c40a01532d599a298183f6d9b7c74b013ac0fa))\\n- **report:** make y-axis label more informative ([7043caa](https://github.com/ts-factory/bublik/commit/7043caa09b7c1f37e75c65b45372634430fd99f7))\\n- **report:** make table header more informative ([2a5b623](https://github.com/ts-factory/bublik/commit/2a5b6232da3c1309d333050a700d8307915a5410))\\n- **report:** change missing results corresponding to the config handling ([c4803aa](https://github.com/ts-factory/bublik/commit/c4803aaba39b0a594c369af211cbffd83b5e7750))\\n- **report:** make not processed points data more informative ([bd6bc4d](https://github.com/ts-factory/bublik/commit/bd6bc4dbc2d8669ae9f633d83e4df160a66d6c50))\\n\\n#### \ud83d\udce6 Chores\\n\\n- **cleanup:** apply linter to report services ([925f1f1](https://github.com/ts-factory/bublik/commit/925f1f17a78a868d85c761368481360937625c93))\\n- **report:** make report config more flexible ([84d0636](https://github.com/ts-factory/bublik/commit/84d0636f3d7525cd8c29f7353b3a44b85872e6ae))\\n- **cleanup:** format code using linter ([a5df1a7](https://github.com/ts-factory/bublik/commit/a5df1a775c96988c47a8ae1aea51726965a88100))\\n- **cleanup:** fix reprs of models objects using f-strings ([6ddf4d8](https://github.com/ts-factory/bublik/commit/6ddf4d8f3bf64e385943c19b6f219522ee83659a))\\n- **cleanup:** add typing of class variables ([7ddbcb3](https://github.com/ts-factory/bublik/commit/7ddbcb31808e0d285586ca76e929e57fc72dd7eb))\\n- **report:** fix f-string quotes error ([0c20433](https://github.com/ts-factory/bublik/commit/0c20433a93ad4c902d94c3b054e1c043ea87955c))"},{"id":"release-v0.3.7","metadata":{"permalink":"/bublik-release/blog/release-v0.3.7","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-09-10-release-v0.3.7/index.mdx","source":"@site/blog/2024-09-10-release-v0.3.7/index.mdx","title":"Release v0.3.7","description":"We are happy to announce Bublik v0.3.7.","date":"2024-09-10T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":0.43,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null}],"frontMatter":{"title":"Release v0.3.7","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.7"},"unlisted":false,"prevItem":{"title":"Release v0.3.9","permalink":"/bublik-release/blog/release-v0.3.9"},"nextItem":{"title":"Release v0.3.8","permalink":"/bublik-release/blog/release-v0.3.8"}},"content":"We are happy to announce **Bublik v0.3.7**.\\n\\nIn this release we\'ve fixed small bug with markdown preview overflowing modal.\\nAlso we\'ve added more meta information for creating new bugs on log page such as hash, CMD, link to full log and link to saved location if you clicked on log line number.\\n\\n\x3c!--truncate--\x3e\\n\\n## Changelog\\n\\n### Frontend\\n\\n### \ud83d\udc1b Bug Fix\\n\\n- **run,log:** fix text overflow in new bug preview modal ([bb556e4](https://github.com/ts-factory/bublik-ui/commit/bb556e4284dad76f006a631dd64195d1eeb18b47))\\n\\n### \ud83d\ude80 New Feature\\n\\n- **log:** added new field to markdown from te-log-meta ([cb3692f](https://github.com/ts-factory/bublik-ui/commit/cb3692f3c72f148540623f9bc176c0d9dc28fa14))"},{"id":"release-v0.3.8","metadata":{"permalink":"/bublik-release/blog/release-v0.3.8","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-09-10-release-v0.3.8/index.mdx","source":"@site/blog/2024-09-10-release-v0.3.8/index.mdx","title":"Release v0.3.8","description":"We are happy to announce Bublik v0.3.8.","date":"2024-09-10T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":0.39,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null}],"frontMatter":{"title":"Release v0.3.8","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.8"},"unlisted":false,"prevItem":{"title":"Release v0.3.7","permalink":"/bublik-release/blog/release-v0.3.7"},"nextItem":{"title":"Release v0.3.6","permalink":"/bublik-release/blog/release-v0.3.6"}},"content":"We are happy to announce **Bublik v0.3.8**.\\n\\nIn this small incremental release we\'ve fixed test parameters env breaking markdown table.\\nWe also wrapped full test path in backticks for better readability.\\n\\n\x3c!--truncate--\x3e\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udc85 Polish\\n\\n- **log,run:** [new-bug] wrapped path to test with backticks ([0f3ca9e](https://github.com/ts-factory/bublik-ui/commit/0f3ca9efe17ec9077d6be7610b46b4f380b92369))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **log,run:** [new-bug] added ability to display cells as code block ([94e7b59](https://github.com/ts-factory/bublik-ui/commit/94e7b59b48a6322195ccda521c23762f531baafe))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **run,log:** [new-bug] fixed env breaking markdown table ([7f9acee](https://github.com/ts-factory/bublik-ui/commit/7f9acee3fcef6e5bbee4e7642a24b7a8c146e270))"},{"id":"release-v0.3.6","metadata":{"permalink":"/bublik-release/blog/release-v0.3.6","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-09-09-release-v0.3.6/index.mdx","source":"@site/blog/2024-09-09-release-v0.3.6/index.mdx","title":"Release v0.3.6","description":"We are happy to announce Bublik v0.3.6.","date":"2024-09-09T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":1.005,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null}],"frontMatter":{"title":"Release v0.3.6","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.6"},"unlisted":false,"prevItem":{"title":"Release v0.3.8","permalink":"/bublik-release/blog/release-v0.3.8"},"nextItem":{"title":"Release v0.3.5","permalink":"/bublik-release/blog/release-v0.3.5"}},"content":"We are happy to announce **Bublik v0.3.6**.\\n\\n\x3c!--truncate--\x3e\\n\\nIn this release we\'ve added objective column for tests on the run page. You can access it via \\"Columns\\" menu in the toolbar.\\nWe\'ve also added \\"New Bug\\" button where you copy prefilled markdown\\n\\n## Highlights\\n\\n### Objective\\n\\nYou can toggle objective column inside column visibility menu\\n\\n![Test objective](./img/objective.png)\\n\\n### New Bug\\n\\n![Run Bug](./img/bug-run.png)\\n\\n![Log Bug Button](./img/log-bug-button.png)\\n\\n![Bug Modal](./img/new-bug-modal.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \u267b Code Refactoring\\n\\n- **run:** added labels to toggle button for full/short run details ([9431427](https://github.com/ts-factory/bublik-ui/commit/9431427e972aa5e87be7beb7c6e8246e3c96948e))\\n- **run:** disabled uppercase all headers by default ([0b87b4e](https://github.com/ts-factory/bublik-ui/commit/0b87b4e351c163cf1b1cfd43db30441524e68887))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **log:** added full path to test in new bug modal ([60bbe17](https://github.com/ts-factory/bublik-ui/commit/60bbe171e3580825b1e070e1beceaf9c984ef9b0))\\n- **log:** added new bug button for log page ([458f871](https://github.com/ts-factory/bublik-ui/commit/458f871a2e4adedc6164b06fb799e0992a298884))\\n- **run:** added new bug button to run page ([875f366](https://github.com/ts-factory/bublik-ui/commit/875f366ace180e19b33b0dded633a5f98315f88b))\\n- **run:** added objective column to run table ([7814984](https://github.com/ts-factory/bublik-ui/commit/7814984329c9557234f646cc298bbd9ced4ff58f))\\n- **ui:** added issue icon to library ([00ee4a5](https://github.com/ts-factory/bublik-ui/commit/00ee4a5bf2d25390af71d67c5276c8518251c55d))\\n- **ui:** added new bug component ([1175af4](https://github.com/ts-factory/bublik-ui/commit/1175af4a403d5af8708a70cc6921e70fe8bc6a87))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **log:** removed redundant query param from bug link ([8bbcd58](https://github.com/ts-factory/bublik-ui/commit/8bbcd58e7bd2d8ab0daa5753a31eab3acf2ec0ab))\\n- **run:** remove redundant rowState query param ([69ae6cf](https://github.com/ts-factory/bublik-ui/commit/69ae6cfca2bbb319304ebb47c513c4f818711785))\\n\\n### Backend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **importruns:** store objectives in the database ([7dd33a6](https://github.com/ts-factory/bublik/commit/7dd33a65f47a6fc4b11d53bf99b3a44eac38507c))\\n- **run stats:** make detailed stats more informative ([c3c987b](https://github.com/ts-factory/bublik/commit/c3c987beb55fe0e1928958c1800b8e7196af20db))"},{"id":"release-v0.3.5","metadata":{"permalink":"/bublik-release/blog/release-v0.3.5","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-08-17-release-v0.3.5/index.mdx","source":"@site/blog/2024-08-17-release-v0.3.5/index.mdx","title":"Release v0.3.5","description":"We are happy to announce Bublik v0.3.5.","date":"2024-08-17T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":0.625,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null}],"frontMatter":{"title":"Release v0.3.5","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.5"},"unlisted":false,"prevItem":{"title":"Release v0.3.6","permalink":"/bublik-release/blog/release-v0.3.6"},"nextItem":{"title":"Release v0.3.4","permalink":"/bublik-release/blog/release-v0.3.4"}},"content":"We are happy to announce **Bublik v0.3.5**.\\n\\n\x3c!--truncate--\x3e\\n\\nIn this minor release we\'ve reverted a change to show full run details by default.\\nWe now hide conclusion reason in run details in short mode.\\nWe also added common args for not processed points table to the report page.\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **report:** added common args for not processed points table ([720da5f](https://github.com/ts-factory/bublik-ui/commit/720da5fe217372c117fff70ca8629c2d2b7a8e48))\\n\\n#### \u267b Code Refactoring\\n\\n- **run,log:** omit conclusion reason from run details in short mode ([fd2817d](https://github.com/ts-factory/bublik-ui/commit/fd2817d603b01c81a24f14aa08e8515dc9c91559))\\n\\n#### \ud83d\udce6 Chores\\n\\n- **run,log:** renamed label from \\"Reason\\" to \\"Conclusion Reason\\" ([b106bb3](https://github.com/ts-factory/bublik-ui/commit/b106bb3009db56e54db40ee7ef80c35b0950c901))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **run,log:** [details] fixed column alignment between term and description ([8a4780c](https://github.com/ts-factory/bublik-ui/commit/8a4780c93c675a07cc22142edf2bee814f8e310c))\\n\\n#### \ud83d\udd04 Reverts\\n\\nRevert \\"chore(log,run): changed option to show full run details by default\\" ([264849e](https://github.com/ts-factory/bublik-ui/commit/264849e9635746dea6a9bd541b73830875e75c6a))"},{"id":"release-v0.3.4","metadata":{"permalink":"/bublik-release/blog/release-v0.3.4","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-08-16-release-v0.3.4/index.mdx","source":"@site/blog/2024-08-16-release-v0.3.4/index.mdx","title":"Release v0.3.4","description":"We are happy to announce Bublik v0.3.4.","date":"2024-08-16T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":0.35,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null}],"frontMatter":{"title":"Release v0.3.4","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.4"},"unlisted":false,"prevItem":{"title":"Release v0.3.5","permalink":"/bublik-release/blog/release-v0.3.5"},"nextItem":{"title":"Release v0.3.3","permalink":"/bublik-release/blog/release-v0.3.3"}},"content":"We are happy to announce **Bublik v0.3.4**.\\n\\n\x3c!--truncate--\x3e\\n\\nThis minor release addresses a critical bug in the report page functionality.\\nPreviously, reports were not displaying all available data, potentially leading to incomplete analysis.\\n\\nWe have resolved this issue, ensuring that all relevant information is now properly presented in the reports.\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **report:** ensure all test blocks are displayed in the report ([658540b](https://github.com/ts-factory/bublik-ui/commit/658540b28cd65d25c7cfa90d5003831905ec467e))"},{"id":"release-v0.3.3","metadata":{"permalink":"/bublik-release/blog/release-v0.3.3","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-08-14-release-v0.3.3/index.mdx","source":"@site/blog/2024-08-14-release-v0.3.3/index.mdx","title":"Release v0.3.3","description":"We are happy to announce Bublik v0.3.3.","date":"2024-08-14T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":3.24,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null}],"frontMatter":{"title":"Release v0.3.3","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.3"},"unlisted":false,"prevItem":{"title":"Release v0.3.4","permalink":"/bublik-release/blog/release-v0.3.4"},"nextItem":{"title":"Release v0.3.2","permalink":"/bublik-release/blog/release-v0.3.2"}},"content":"We are happy to announce **Bublik v0.3.3**.\\n\\n\x3c!--truncate--\x3e\\n\\nIn this release, we\'ve introduced several new features and improvements.\\nWe\'ve added conclusion reason hover cards to the dashboard, run details, and runs page, enhancing user information.\\nA new report data zoom functionality for plots has been implemented, along with a preview log modal for the run page.\\nWe\'ve also made various UI enhancements, including improved table column width distribution in reports and the addition of an align property to the hover-card component.\\nBug fixes include resolving issues with broken links, error displays. Also the Bublik is now compatible with Ubuntu 24.04. The bugs related to importing from the source have also been solved.\\n\\n## Highlights\\n\\n### Specifying Measurements In Report Configuration\\nWe have added the ability to specify several sets of measurement parameters in the configuration to make reporting more flexible. The list of possible measurement parameters has also expanded \u2014 it is now possible to specify a tool. An example of the run report configuration can be found in [doc/wiki/report\\\\_config.json](https://github.com/ts-factory/bublik/blob/main/doc/wiki/report_config.json).\\n\\n> **Note!**\\n> Due to the above changes, **the configuration format has been changed**. See the example at the link above.\\n\\n### Not Processed Iterations In Reports\\n\\n![Report iterations](./img/iterations.png)\\n\\n### Log Preview\\n\\nWe\'ve also added log preview to the run page so you have a quick glance of the log without having to go to the full log page.\\n\\n![Log Preview](./img/log-preview.png)\\n\\n![Log Preview Modal](./img/log-preview-modal.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udd27 Continuous Integration | CI\\n\\n- added formatting check ([c84a564](https://github.com/ts-factory/bublik-ui/commit/c84a564c2fadcc5748fa168d029b178fbaf5dd1c))\\n- run formatter on code base ([4da8c4b](https://github.com/ts-factory/bublik-ui/commit/4da8c4b96944aab2d466929968818435dc9ca38f))\\n- splitted and steps into different jobs ([8de0f52](https://github.com/ts-factory/bublik-ui/commit/8de0f52a62cd757caac831ff8b87048464f610c6))\\n- swapped to prettier for formatting checks ([8170886](https://github.com/ts-factory/bublik-ui/commit/81708860b7c363f3cbca1640318f351c0bc77c15))\\n\\n#### \ud83d\udce6 Chores\\n\\n- added vscode dir to gitignore ([6fe10f3](https://github.com/ts-factory/bublik-ui/commit/6fe10f31644c3956eb17dcc8a51558110c6343f0))\\n- **deps:** upgrade nx to latest version ([bdaa929](https://github.com/ts-factory/bublik-ui/commit/bdaa929350be5dc2acdb04aa807554c28937f0d2))\\n- **log,run:** changed option to show full run details by default ([f5257f0](https://github.com/ts-factory/bublik-ui/commit/f5257f0a2d73fd791076ce5cd4c15d75aaabe666))\\n- **storybook:** remove all mocked modules ([2f4ab3d](https://github.com/ts-factory/bublik-ui/commit/2f4ab3d3fa78532488ca10224d5a7bbb9c580c09))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **report:** made table columns take even width ([8981192](https://github.com/ts-factory/bublik-ui/commit/8981192c72e0b8f7ddbf17dcf6f43d4b75245ec9))\\n- **ui:** [hover-card] added align prop ([95cf988](https://github.com/ts-factory/bublik-ui/commit/95cf9881306dfc90109bd2b31aa3f1bb54082539))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **report:** fixed broken link to report section ([31f3004](https://github.com/ts-factory/bublik-ui/commit/31f3004f07271251e3b78244aedb8411b4817798))\\n- **report:** fixed not showing error if no config id or run id present ([810ea12](https://github.com/ts-factory/bublik-ui/commit/810ea12d8c160dd671277595c56850cf8eeb2035))\\n- **storybook:** fixed wrong location for vite config ([81d7cf2](https://github.com/ts-factory/bublik-ui/commit/81d7cf2da5aa9fbe159c674c15dcff39a9d8e0cd))\\n- **ui:** fixed typescript issues in tailwind-ui ([9d22183](https://github.com/ts-factory/bublik-ui/commit/9d221838ca11c85f08e58511bd5857fab2bd1364))\\n\\n#### \u267b Code Refactoring\\n\\n- **report:** added not processed points table ([b6c8025](https://github.com/ts-factory/bublik-ui/commit/b6c80250f37195fc6da044cf5d19bc9a70181d34))\\n- **report:** upgraded to latest changes ([113c4b6](https://github.com/ts-factory/bublik-ui/commit/113c4b6a50ff2b500a3ec33d0519c4465322504e))\\n- **run:** extracted conclusion badge to shared UI lib ([fa583d8](https://github.com/ts-factory/bublik-ui/commit/fa583d8ead7d9b00fa9552e8def819b667695174))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **dashboard:** added conclusion reason hover card to dashboard ([390685b](https://github.com/ts-factory/bublik-ui/commit/390685b7e623db855ed54dde78a0a7849c0dadf7))\\n- **report:** added report data zoom to plot ([716a7ac](https://github.com/ts-factory/bublik-ui/commit/716a7ac7487f00dc4eb2f7b25493181414a9ab4b))\\n- **run:** added conclusion reason hover card to run details ([d7a6288](https://github.com/ts-factory/bublik-ui/commit/d7a628818f7ae6e0387618b8fc4d3a279679a879))\\n- **run:** added preview log modal ([5c4056c](https://github.com/ts-factory/bublik-ui/commit/5c4056c3e8565000d4c3d1f7fd308ed8a0c51d6a))\\n- **runs:** added conclusion reason hover card to runs page ([b3215c9](https://github.com/ts-factory/bublik-ui/commit/b3215c91692a0eab9182b42c1132f1838297c37a))\\n- **ui:** added conclusion hover card component to ui lib ([1183ee4](https://github.com/ts-factory/bublik-ui/commit/1183ee4427e8c5b20a15dfb9806fea82cf1caea8))\\n\\n### Backend\\n\\n#### \ud83d\udd28 Issue Fix\\n\\n- Error in calculating detailed run statistics [#3](https://github.com/ts-factory/bublik/issues/3)\\n- Error when trying to copy a short URL [#44](https://github.com/ts-factory/bublik/issues/44)\\n- Importruns: source page parsing error [#48](https://github.com/ts-factory/bublik/issues/48)\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **requirements:** update packages versions to pick up bug fixes ([87821b4](https://github.com/ts-factory/bublik/commit/87821b4146cc5316086f37b4d678b48d37d1bcfd))\\n- **flower:** fix no workers in flower after start ([b77a9d4](https://github.com/ts-factory/bublik/commit/b77a9d464af82dca7a705d3859ce831ef58325d0))\\n- **report:** fix empty percentage base value handling ([cbd8433](https://github.com/ts-factory/bublik/commit/cbd8433c88bb0fe6541e40f7e2b6fd5d0a19a7ad))\\n- **report:** fix invalid iterations handling ([fac211d](https://github.com/ts-factory/bublik/commit/fac211d8bdfaf13deeb927e47d35355b5757683c))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **requirements:** fix incompatibility with Ubuntu 24.04 ([070a189](https://github.com/ts-factory/bublik/commit/070a1890ed86871121b965c1a783a34b4c821153))\\n- **readme:** update info about supported OS versions ([24c5daa](https://github.com/ts-factory/bublik/commit/24c5daae76db1019510a0df6639dd5b431aa1654))\\n- **run stats:** make the conclusion clearer ([8bf342c](https://github.com/ts-factory/bublik/commit/8bf342c77610d0e85525b2961422d5e3aad8fc68))\\n- **report:** expand possibilities of measurement setting ([ef359e3](https://github.com/ts-factory/bublik/commit/ef359e30cb3dc0b6a61b1af7382aac5ce3daf235))\\n\\n#### \ud83d\udce6 Chores\\n\\n- **deploy:** make deploy more flexible ([b11ce2e](https://github.com/ts-factory/bublik/commit/b11ce2edeb013bc8c97319ffff8c451c8e3aac65))\\n- **report:** update report content structure ([0ef4d8e](https://github.com/ts-factory/bublik/commit/0ef4d8e5c058650701dc27970fe0205ac14cd30a))\\n- **report:** ensure the uniqueness of IDs throughout the report ([bc15682](https://github.com/ts-factory/bublik/commit/bc15682c36f84fcbf0bd6e2f009bb00e25754aa6))\\n\\n\\n#### \u267b Code Refactoring\\n\\n- **settings:** fix import of settings ([12b04f6](https://github.com/ts-factory/bublik/commit/12b04f6652ecd2072d2a3e416ce8df3024546327))\\n- **auth:** remove dup of getting user by access token ([f2e563e](https://github.com/ts-factory/bublik/commit/f2e563e9ff5e2ca38ff1ff76eaba6a416d318fa5))\\n- **auth:** decompose admin verification for readability ([2643347](https://github.com/ts-factory/bublik/commit/264334715a63d75520747340b96fd77b4d024ee5))\\n- **auth:** unify authentication and admin verification ([352bb06](https://github.com/ts-factory/bublik/commit/352bb0618542adf6ee214bab93c6fd5afd210014))\\n- **auth:** move auth funcs for consistency ([9bb9300](https://github.com/ts-factory/bublik/commit/9bb9300fa33bb5d5593d5ddedf6aa011ca822983))"},{"id":"release-v0.3.2","metadata":{"permalink":"/bublik-release/blog/release-v0.3.2","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-07-04-release-v0.3.2/index.mdx","source":"@site/blog/2024-07-04-release-v0.3.2/index.mdx","title":"Release v0.3.2","description":"We are happy to announce Bublik v0.3.2.","date":"2024-07-04T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":1.24,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null}],"frontMatter":{"title":"Release v0.3.2","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.2"},"unlisted":false,"prevItem":{"title":"Release v0.3.3","permalink":"/bublik-release/blog/release-v0.3.3"},"nextItem":{"title":"Release v0.3.1","permalink":"/bublik-release/blog/release-v0.3.1"}},"content":"We are happy to announce **Bublik v0.3.2**.\\n\\n\x3c!--truncate--\x3e\\n\\nIn the latest release, we\'ve implemented several updates and improvements. We\'ve reordered buttons and links on run page. A new feature has been added to display aggregated values min/max in the logs. Bug fixes include modifying the log display to show only entries with aggr of \\"single\\" on the chart, sorting points by x-axis value on a chart in reports, making report configs and building charts in reports more flexible, making datasets for charts and tables optional in reports, and removing the \\"%\\" sign for values that are \\"-\\" or \\"na\\" in reports.\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udce6 Chores\\n\\n- **build:** upgraded pnpm setup action to latest version ([290ad77](https://github.com/ts-factory/bublik-ui/commit/290ad7757b9f588412c24138a45fd2d38d695ae0))\\n- **run:** [details] changed order of buttons and links ([fe9b024](https://github.com/ts-factory/bublik-ui/commit/fe9b0244ccf323f1278fac908e7bbe11f0724553))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **log:** [mi] added display for aggregated values min/max ([f476678](https://github.com/ts-factory/bublik-ui/commit/f476678ca34370d6a39e2b84f099e84eb22fb138))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **log:** [mi] display only entries with `aggr` of \\"single\\" on chart ([e391d2a](https://github.com/ts-factory/bublik-ui/commit/e391d2aa6a78dfed7139e6d48783641eb8b6be84))\\n- **reports:** made datasets for chart/table optional ([ff7d724](https://github.com/ts-factory/bublik-ui/commit/ff7d724b37885c0f1fe00c2026c7dccf2f302027))\\n- **reports:** removed `%` for values that are \\"-\\" or \\"na\\" ([88e7416](https://github.com/ts-factory/bublik-ui/commit/88e74167b337f2518bab036c2a0882d5cb9a9318))\\n\\n### Backend\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **report:** fix incorrect measurement results order in datasets ([2636d9e](https://github.com/ts-factory/bublik/commit/2636d9ea9d54e41ebf0518867bbb83eea4f09019))\\n- **reports:** fix generation of record IDs ([bba7bcf](https://github.com/ts-factory/bublik/commit/bba7bcf351c138a3494fd7dcaac2815272cac88f))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **report:** allow extra args in \'records\\\\_order\' in config ([0301ce1](https://github.com/ts-factory/bublik/commit/0301ce1a5d98198508d1f44869451368bfeb278c))\\n- **report:** change handling of non-numeric values of x-axis arg ([af65dac](https://github.com/ts-factory/bublik/commit/af65dac3645a9ef9ba195c127cba5187ae3393e5))\\n\\n#### \ud83d\udce6 Chores\\n\\n- **report:** make measurement units more readable ([803c9a8](https://github.com/ts-factory/bublik/commit/803c9a849756455ac2eb1ba1511e8c9b45492ee9))\\n- **cleanup:** apply linter to reports related code ([840543c](https://github.com/ts-factory/bublik/commit/840543cb6d2e9ccb75b9bcec179b11d56a4e98aa))"},{"id":"release-v0.3.1","metadata":{"permalink":"/bublik-release/blog/release-v0.3.1","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-06-28-release-v0.3.1/index.mdx","source":"@site/blog/2024-06-28-release-v0.3.1/index.mdx","title":"Release v0.3.1","description":"We are happy to announce Bublik v0.3.1.","date":"2024-06-28T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":2.16,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null}],"frontMatter":{"title":"Release v0.3.1","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.1"},"unlisted":false,"prevItem":{"title":"Release v0.3.2","permalink":"/bublik-release/blog/release-v0.3.2"},"nextItem":{"title":"Release v0.3.0","permalink":"/bublik-release/blog/release-v0.3.0"}},"content":"We are happy to announce **Bublik v0.3.1**.\\n\\n\x3c!--truncate--\x3e\\n\\nIn the latest release of our app, we\'ve introduced several new features and improvements. Notably, we\'ve enhanced the history search form with a new `labels` field.\\nThe reports section now supports more detailed filtering by measurements, the use of partially suitable configurations, formatters to display \\"%\\" signs, handles API errors more gracefully, and added table titles. We\'ve also fixed various bugs, including default values in the history search form. Additionally, we polished the UI with background overlays in the command menu.\\n\\n## Highlights\\n\\n### Run Reports\\nNow, when building a run report, you can specify the measurements, the results of which will be contained in the report, not only by specifying the names of these measurements, but also by specifying aggregation and keys. This information must be specified in the report configuration. An example can be found in [doc/wiki/report\\\\_config.json](https://github.com/ts-factory/bublik/blob/main/doc/wiki/report_config.json).\\n\\n> **Note!**\\n> Due to the above changes, **the configuration format has been changed**. See the example at the link above.\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **history:** added labels field to history global search form ([5fc9e7b](https://github.com/ts-factory/bublik-ui/commit/5fc9e7b0418843fefa78ae7c744d1fb341b8f441))\\n- **history:** added scroll to top of the page on page change ([634934f](https://github.com/ts-factory/bublik-ui/commit/634934fce95fc155a0955056f984fe15ba67945f))\\n- **reports:** added formatters support to show \\"%\\" sign ([5e55703](https://github.com/ts-factory/bublik-ui/commit/5e55703929e931e864c5ac0806770bf8c77cef3f))\\n- **reports:** added handling for API errors for report page ([323d7ba](https://github.com/ts-factory/bublik-ui/commit/323d7bafbdcde44a074132dbc27034b5dc356b70))\\n- **reports:** added table title from Y axis label ([c5d3498](https://github.com/ts-factory/bublik-ui/commit/c5d3498f51f1d5b2184eaef231af3bf27a71bed2))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **history:** fixed missing default values for history global search form ([f096099](https://github.com/ts-factory/bublik-ui/commit/f09609984044c74193441d909ef6334aff83b385))\\n- **history:** made field names consistent in search form ([6f569af](https://github.com/ts-factory/bublik-ui/commit/6f569afd25428e4640b2d13b37790fa131def6d6))\\n- **log:** added option to contain label inside canvas container ([5c07946](https://github.com/ts-factory/bublik-ui/commit/5c079461bb1a8c04168f19b7bab6009f96197ccc))\\n- **reports:** fixed axis label overflow inside canvas container ([79b5416](https://github.com/ts-factory/bublik-ui/commit/79b541646f429c2d14bfb7b62e3854a0180643bb))\\n- **reports:** fixed unstable key for report header list item ([a6ac058](https://github.com/ts-factory/bublik-ui/commit/a6ac058b7e85caf3f7704027a895b74c0a425289))\\n- **run:** fixed copying revision metadata without key ([eefdf45](https://github.com/ts-factory/bublik-ui/commit/eefdf45f9d8eeb2b206a1678048db72d835b5482))\\n- **runs:** [form] fixed crash when opening tags input ([90e3df6](https://github.com/ts-factory/bublik-ui/commit/90e3df62602eb510344649eb9e8f0f0bd0e101c9))\\n- **ui:** [combobox] fixed selection change callback type ([9d16f19](https://github.com/ts-factory/bublik-ui/commit/9d16f197c3078560c944739fef630646fd551773))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **command:** added background overlay to command menu ([08bf23e](https://github.com/ts-factory/bublik-ui/commit/08bf23e6b43d0c1c45d7cf2921c852eabd9b9767))\\n- **run:** [reports] added gap between exit icon and report label ([de2dd4d](https://github.com/ts-factory/bublik-ui/commit/de2dd4dd698e8864bc250a7ea0ec6ca60668ecf5))\\n\\n### Backend\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **report:** fix filtering by measurements ([54431c4](https://github.com/ts-factory/bublik/commit/54431c434afe8279598b7824f38e9773f54cfe0d))\\n- **report:** support unequal measurement sequences ([97ec69a](https://github.com/ts-factory/bublik/commit/97ec69a72650153782c6e58f958ffc67ded18f64))\\n- **report:** fix calculation of percentages ([e306157](https://github.com/ts-factory/bublik/commit/e306157f60abe7f77b4fe7d3c76487a3e92b868a))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **report:** add accounting for measurement keys and aggr ([ccd75a0](https://github.com/ts-factory/bublik/commit/ccd75a0c7cf805ba1223724659b92972f9946c87))\\n- **report:** make the name of y axis more informative ([bd6a38f](https://github.com/ts-factory/bublik/commit/bd6a38f763105b3e8035a1754d265696df7ea5ac))\\n- **report:** add formatters for table column values ([af1510f](https://github.com/ts-factory/bublik/commit/af1510f4c3289957eb13c7e334787a47d5ddf3a3))\\n- **report:** make it possible to use partially suitable config ([51f29c7](https://github.com/ts-factory/bublik/commit/51f29c7ee392d96fc0ae52b8820c2b776a30b29a))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **cleanup:** replace special Unicode characters ([81109f0](https://github.com/ts-factory/bublik/commit/81109f00243e041e8eeaea6efa9bf01f9ba70434))\\n- **doc/wiki:** fix style in report config example ([db1a6e0](https://github.com/ts-factory/bublik/commit/db1a6e0c61335b8fd9b6bdb58ff3007570cbfbac))"},{"id":"release-v0.3.0","metadata":{"permalink":"/bublik-release/blog/release-v0.3.0","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-06-06-release-v0.3.0/index.mdx","source":"@site/blog/2024-06-06-release-v0.3.0/index.mdx","title":"Release v0.3.0","description":"We are happy to announce Bublik v0.3.0.","date":"2024-06-06T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":2.595,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null}],"frontMatter":{"title":"Release v0.3.0","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.0"},"unlisted":false,"prevItem":{"title":"Release v0.3.1","permalink":"/bublik-release/blog/release-v0.3.1"},"nextItem":{"title":"Release v0.2.6","permalink":"/bublik-release/blog/release-v0.2.6"}},"content":"We are happy to announce **Bublik v0.3.0**.\\n\\n\x3c!--truncate--\x3e\\n\\nIn this relaese we\'ve added a new page featuring charts and tables to visualize and analyze run reports. Introduced a button that allows users to easily copy a short URL of the current page for sharing.\\nAdded navigation shortcuts for quick access to pages, enhancing user experience.\\n\\n## Highlights\\n\\n### Run Reports\\n\\nNow you can use Bublik for run reports building. To build a run report, an appropriate configuration is required. Information about the run report configuration format and its location can be found in [doc/wiki/reports.md](https://github.com/ts-factory/bublik/blob/main/doc/wiki/reports.md). An example of the run report configuration can be found in [doc/wiki/report_config.json](https://github.com/ts-factory/bublik/blob/main/doc/wiki/report_config.json).\\n\\nYou can find available reports on run page\\n\\n![Report Button](./img/report-1.png)\\n\\n![Report Page](./img/report-2.png)\\n\\n### Copy Short Link\\n\\nYou can shortcut button to copy short link of the current page on right top corner\\n\\n![Copy Link Button Run Page](./img/copy-1.png)\\n\\n![Copy Link Button Runs Page](./img/copy-2.png)\\n\\n### Command Menu\\n\\nWe\'ve added command menu with some shortcuts to common actions, pages\\n\\n![Command](./img/cmd-1.png)\\n\\nAlso you can copy short link to current page from command menu\\n\\n![Command Copy](./img/cmd-2.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n* **reports:** added missing dependency to useMemo hook for args calculation ([b67f56b](https://github.com/ts-factory/bublik-ui/commit/b67f56bf8378c5556eaedce4553f0f40cb99e7bb))\\n* **reports:** added missing dependency to useMemo hook for chart series calculation ([38b7682](https://github.com/ts-factory/bublik-ui/commit/38b7682b700d5ad82430219adfce7858d0009b40))\\n* **reports:** added rel=\\"noreferrer\\" to external links ([8670993](https://github.com/ts-factory/bublik-ui/commit/867099344a49554f29899729860d032969e20aa7))\\n* **reports:** fixed build issues with tests ([d965e1b](https://github.com/ts-factory/bublik-ui/commit/d965e1b6692939c2b92775659cbb208df7c4d425))\\n* **reports:** fixed scroll to element id containing only numbers ([960d826](https://github.com/ts-factory/bublik-ui/commit/960d826842271495710927543bf0d46f2c0b948c))\\n* **reports:** prevent conditional calling of API query hook ([976998b](https://github.com/ts-factory/bublik-ui/commit/976998be71777a01290482fd0ffd50aca09d1ce1))\\n\\n\\n#### \ud83d\udc85 Polish\\n\\n* **reports:** added underline on hover for revision link ([9dc8ab3](https://github.com/ts-factory/bublik-ui/commit/9dc8ab3ff464eeb72dc2675ed3cf8e8a0ce73b2a))\\n* **reports:** fixed styles for dropdown menu item ([89a7921](https://github.com/ts-factory/bublik-ui/commit/89a7921867a4be3710a06cbb4ee8f420d027257d))\\n\\n\\n#### \ud83d\udce6 Chores\\n\\n* **copy-short-url:** upgraded cmdk package to latest version ([196d26b](https://github.com/ts-factory/bublik-ui/commit/196d26bddd609e802705f20a5cf5ace1b676a598))\\n* **icons:** added upload icon to icon library ([9ea35bb](https://github.com/ts-factory/bublik-ui/commit/9ea35bb226ba1c4b7b5812342bea7a771e7521d6))\\n* **reports:** extracted run-report test block ([17ac977](https://github.com/ts-factory/bublik-ui/commit/17ac97789e9b34e738761faa2d8bd93687eb2fb3))\\n* **reports:** generated library for run report ([c8fdf56](https://github.com/ts-factory/bublik-ui/commit/c8fdf56646407d7d9a0e7ef16205754bc26795ff))\\n\\n\\n#### \ud83d\ude80 New Feature\\n\\n* **copy-short-url:** added \\"copy short url\\" button to dashboard page ([5794f1b](https://github.com/ts-factory/bublik-ui/commit/5794f1bd990b99029ade8224ecdf6bdaf54f2be9))\\n* **copy-short-url:** added \\"copy short url\\" button to history page ([4f5aa78](https://github.com/ts-factory/bublik-ui/commit/4f5aa785eeb8d9268fba4757d2c80192fc2ea0c6))\\n* **copy-short-url:** added \\"copy short url\\" button to run page ([a661fed](https://github.com/ts-factory/bublik-ui/commit/a661fed0888727398fc44a304cdddd52f9baa501))\\n* **copy-short-url:** added \\"copy short url\\" to runs page ([6afdd3a](https://github.com/ts-factory/bublik-ui/commit/6afdd3a5bcf0896a00e0acab3b3be29438586f93))\\n* **copy-short-url:** added \\"copy-short-url\\" button to log page ([19b6ce1](https://github.com/ts-factory/bublik-ui/commit/19b6ce1316de6cf3c7aedcb3425602e4ab4af4bc))\\n* **copy-short-url:** added \\"copy-short-url\\" button to measurements page ([3aa5b5e](https://github.com/ts-factory/bublik-ui/commit/3aa5b5e7e89acbbb4ab90f8484da9ed1d11c521a))\\n* **copy-short-url:** added \\"copy-short-url\\" button to run page ([ba2ff97](https://github.com/ts-factory/bublik-ui/commit/ba2ff97a93a8961b02c36c9ef92d7f591a5f6105))\\n* **copy-short-url:** added button for copying short url to current page ([02af6f8](https://github.com/ts-factory/bublik-ui/commit/02af6f8ef0cacd95fef206a4cdba60f5106b08db))\\n* **copy-short-url:** added command component ([8c416c1](https://github.com/ts-factory/bublik-ui/commit/8c416c1e023585ec6c93d01c205b0489d4373caa))\\n* **copy-short-url:** added component for command to copy short url ([a5459d3](https://github.com/ts-factory/bublik-ui/commit/a5459d301a0b63059462b824633842e2043bde1a))\\n* **copy-short-url:** added endpoint for creating short url ([2fd89dd](https://github.com/ts-factory/bublik-ui/commit/2fd89ddf9f379861c29d4e15a45ceff101b1f923))\\n* **copy-short-url:** generated library for \\"copy short url button\\" ([04a0931](https://github.com/ts-factory/bublik-ui/commit/04a093141098c9f6c1cb856656aa81e699f5a3bd))\\n* **reports:** added dropdown for run configs links ([c5fb281](https://github.com/ts-factory/bublik-ui/commit/c5fb2811ffe8656714d499ef090df4ccd5e09fc6))\\n* **reports:** added initial report header ([dc1195c](https://github.com/ts-factory/bublik-ui/commit/dc1195c2471d0dbfc1c70d4fc07199d3187947eb))\\n* **reports:** added run report container component ([48591fc](https://github.com/ts-factory/bublik-ui/commit/48591fc4d874ddceb0bf614efa6c9de6e72d1ce4))\\n* **reports:** added sidebar link for run report ([bdc2f1c](https://github.com/ts-factory/bublik-ui/commit/bdc2f1c9aadd5892b65ea7c1ae614c341027bc68))\\n* **reports:** added table and chart components ([4e4d3a7](https://github.com/ts-factory/bublik-ui/commit/4e4d3a75d17c8c03f6b898265b65d4d4333fc42a))\\n* **reports:** added warnings popover ([46d983d](https://github.com/ts-factory/bublik-ui/commit/46d983dad714768c6f6676d1b4d1dba4c22c8dcd))\\n* **reports:** made revision links clickable ([41d50d8](https://github.com/ts-factory/bublik-ui/commit/41d50d8dbb44d47e1daf735d64ad0beedfe264e9))\\n\\n### Backend\\n\\n#### \ud83d\udd28 Issue Fix\\n\\n- Support Debian 12 [#17](https://github.com/ts-factory/bublik/issues/17)\\n- Add URL shortner [#26](https://github.com/ts-factory/bublik/issues/26)\\n- Add run reports support [#32](https://github.com/ts-factory/bublik/issues/32)\\n\\n#### \ud83d\udce6 Chores\\n\\n- **cleanup:** remove unnecessary logging ([32dadc6](https://github.com/ts-factory/bublik/commit/32dadc6cc862f3a7b38b8be4efa5cd9d90bb4a34))\\n- **cleanup:** remove unnecessary manage.py call ([4faeba9](https://github.com/ts-factory/bublik/commit/4faeba97b3763ed8ef1291ba2127e81be5f4a036))"},{"id":"release-v0.2.6","metadata":{"permalink":"/bublik-release/blog/release-v0.2.6","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-05-12-release-v0.2.6/index.mdx","source":"@site/blog/2024-05-12-release-v0.2.6/index.mdx","title":"Release v0.2.6","description":"We are happy to announce Bublik v0.2.6.","date":"2024-05-12T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":1.16,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null}],"frontMatter":{"title":"Release v0.2.6","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.2.6"},"unlisted":false,"prevItem":{"title":"Release v0.3.0","permalink":"/bublik-release/blog/release-v0.3.0"},"nextItem":{"title":"Release v0.2.5","permalink":"/bublik-release/blog/release-v0.2.5"}},"content":"We are happy to announce **Bublik v0.2.6**.\\n\\n\x3c!--truncate--\x3e\\n\\nThis release introduces a series of small, incremental changes aimed at enhancing user experience and addressing various issues.\\nIt includes fixes for parameter-related crashes and fixes issue with parameter diff on run page.\\nAdditionally, constraints for minimum and maximum values have been added to charts.\\nNow when clicking on test in log tree log frame will be scrolled to the top to reset, We also added stacked chart mode for measurements page.\\nOverall, these updates contribute to a smoother and more refined user interface.\\n\\nBackend improvements include fixing issues with importruns.\\n\\n> **Note!**\\n> After upgrading to this version, it is necessary to clean up the databases of projects using live import:\\n> it is necessary to find and re-import runs for which TestIterationResult objects with the same `exec_seqno` exist in the database. \\n\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udce6 Chores\\n\\n- fix run library test config ([4f3df15](https://github.com/ts-factory/bublik-ui/commit/4f3df15d2c95896a609e6c0bc4d79aefc77d335e))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **log:** [chart] add constraints for min/max values ([88b5262](https://github.com/ts-factory/bublik-ui/commit/88b52621ab4324d1313dc3ee1f5d5d67e98fb98c))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **charts:** correct tooltip message for zoom button ([aeaa1ea](https://github.com/ts-factory/bublik-ui/commit/aeaa1ea162e43c6a037dca948f9a9522b65a26e3))\\n- **run:** result parameters diff crashing on some results ([d196c74](https://github.com/ts-factory/bublik-ui/commit/d196c74f093fa8dbe8c6adbce99de907bac9b34b))\\n\\n#### \ud83d\udc77\u200d Build System\\n\\n- enable sourcemaps ([976756c](https://github.com/ts-factory/bublik-ui/commit/976756ce1bda98d6d5c2549a5c7f724c5534d268))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **log:** scroll to top of log on test click ([e6cfda2](https://github.com/ts-factory/bublik-ui/commit/e6cfda2d8f940f52452630fd7fb270ee7de97c42))\\n- **measurements:** add stacked chart mode ([5ad0f20](https://github.com/ts-factory/bublik-ui/commit/5ad0f20e614435ac30c19ae1542e1bc2bee1c7d4))\\n\\n### Backend\\n\\n#### \ud83d\udd28 Issue Fix\\n\\n- Update during importruns error [#29](https://github.com/ts-factory/bublik/issues/29)"},{"id":"release-v0.2.5","metadata":{"permalink":"/bublik-release/blog/release-v0.2.5","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-04-12-release-v0.2.5/index.mdx","source":"@site/blog/2024-04-12-release-v0.2.5/index.mdx","title":"Release v0.2.5","description":"We are happy to announce Bublik v0.2.5.","date":"2024-04-12T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":1.475,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null}],"frontMatter":{"title":"Release v0.2.5","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.2.5"},"unlisted":false,"prevItem":{"title":"Release v0.2.6","permalink":"/bublik-release/blog/release-v0.2.6"},"nextItem":{"title":"Release v0.2.4","permalink":"/bublik-release/blog/release-v0.2.4"}},"content":"We are happy to announce **Bublik v0.2.5**.\\n\\n\x3c!--truncate--\x3e\\n\\nThis update brings numerous enhancements to both the frontend and backend of Bublik.\\n\\n- On the frontend, fixes were made to address issues like page overflow in the log section\\n- Adapting search parameters to API changes in history.\\n- Fixed app crashes due to toast messages on email confirmation page.\\n- Various issues in the history section were resolved\\n- We changed default logs to experimental ones by default. You can toggle those off in user settings if you have issues with experimental or use button above \\"Legacy\\" to disable experimental logs.\\n- Backend improvements include fixing issues with detailed run statistics\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udc85 Polish\\n\\n- **log:** fix horizontal page overflow ([803c05c](https://github.com/ts-factory/bublik-ui/commit/803c05c27c99c1e88d34ef28d0048e9e26deea3e))\\n\\n#### \u267b Code Refactoring\\n\\n- **history:** adapt search params to api changes ([91ae184](https://github.com/ts-factory/bublik-ui/commit/91ae184af0c0916cc074795f4c28b2c4379ef1a0))\\n\\n#### \ud83d\udce6 Chores\\n\\n- **log:** change default log mode to experimental ([d851f04](https://github.com/ts-factory/bublik-ui/commit/d851f0412fc47c38455c103d709b7ba7f5592f0c))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **auth:** prevent app crash caused by toast messages ([ce1211f](https://github.com/ts-factory/bublik-ui/commit/ce1211ff30bffadfc4d246d0bb012a6714c51d2e))\\n- **history:** [checkbox] prevent double select ([ab1d2ed](https://github.com/ts-factory/bublik-ui/commit/ab1d2ed3e5818a7fab759efe5aae4780ed22b148))\\n- **history:** [form] missing default values ([ed7a34a](https://github.com/ts-factory/bublik-ui/commit/ed7a34ae00d474530a0ca1172de7a51f71437fd8))\\n- **history:** not display dates in legend ([41a2a5a](https://github.com/ts-factory/bublik-ui/commit/41a2a5a156ecd3eefe1c385060635478cf74ad8a))\\n- **history:** skipping fetching data on direct navigation ([bc721e1](https://github.com/ts-factory/bublik-ui/commit/bc721e1994a1fa34289051633616f00ba9462979))\\n- **log:** scroll to saved line ([41cf356](https://github.com/ts-factory/bublik-ui/commit/41cf3567a58cf15dd654fb6c7f4b24b92a6f2c9d))\\n\\n### Backend\\n\\n#### \ud83d\udd28 Issue Fix\\n\\n- Negative values in detailed run statistics [#20](https://github.com/ts-factory/bublik/issues/20)\\n- Strange percentages in run statistics [#22](https://github.com/ts-factory/bublik/issues/22)\\n\\n#### \ud83d\udce6 Chores\\n\\n- **history:** unify names of query params containing metas ([3c7e056](https://github.com/ts-factory/bublik/commit/3c7e0564730bc34c887a49d2eee66ac0affb84c4))\\n- **history:** support filtering by metas with type label ([bbd72e6](https://github.com/ts-factory/bublik/commit/bbd72e6c46e4101f7459f16837283c40437e1c08))\\n- **history:** structure the use of metas and their exprs ([9f400c0](https://github.com/ts-factory/bublik/commit/9f400c042bc701ef199641d82935cc921129d96b))\\n- **history:** structure the getting of query params ([94c853b](https://github.com/ts-factory/bublik/commit/94c853be40d970be17e995b6f9caa2251cbd0166))\\n- **history:** fix query param and variable names ([84f5342](https://github.com/ts-factory/bublik/commit/84f5342c51eabe8ad3e4831410e3336c67ec5044))\\n- **history:** add comments and division into blocks ([b00caac](https://github.com/ts-factory/bublik/commit/b00caac3015021ddadd7b7da7e46c536b21a59b6))\\n- **history:** make the order of getting data more logical ([09f06e7](https://github.com/ts-factory/bublik/commit/09f06e7f2ab15f75d2bbd20d56ddb991e1f98cd5))"},{"id":"release-v0.2.4","metadata":{"permalink":"/bublik-release/blog/release-v0.2.4","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-03-12-release-v0.2.4/index.mdx","source":"@site/blog/2024-03-12-release-v0.2.4/index.mdx","title":"Release v0.2.4","description":"We are happy to announce Bublik v0.2.4.","date":"2024-03-12T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":0.28,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null}],"frontMatter":{"title":"Release v0.2.4","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.2.4"},"unlisted":false,"prevItem":{"title":"Release v0.2.5","permalink":"/bublik-release/blog/release-v0.2.5"},"nextItem":{"title":"Release v0.2.3","permalink":"/bublik-release/blog/release-v0.2.3"}},"content":"We are happy to announce **Bublik v0.2.4**.\\n\\n\x3c!--truncate--\x3e\\n\\nThe release, a small incremental update, prioritizes performance improvements by optimizing log tree representation.\\nThis involves refining the structure of the tree to enhance efficiency,\\nmaking operations within the backend system more streamlined and faster.\\n\\n## Changelog\\n\\n### Backend\\n\\n#### \u26a1 Performance\\n\\n- **tree:** optimize tree representation ([0cd05c6](https://github.com/ts-factory/bublik/commit/0cd05c64bb275ec949d0aeddd0f89a46a7735be4))"},{"id":"release-v0.2.3","metadata":{"permalink":"/bublik-release/blog/release-v0.2.3","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-02-23-release-v0.2.3/index.mdx","source":"@site/blog/2024-02-23-release-v0.2.3/index.mdx","title":"Release v0.2.3","description":"We are happy to announce Bublik v0.2.3.","date":"2024-02-23T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":0.915,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null}],"frontMatter":{"title":"Release v0.2.3","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.2.3"},"unlisted":false,"prevItem":{"title":"Release v0.2.4","permalink":"/bublik-release/blog/release-v0.2.4"},"nextItem":{"title":"Release v0.2.2","permalink":"/bublik-release/blog/release-v0.2.2"}},"content":"We are happy to announce **Bublik v0.2.3**.\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n### User preferences\\n\\nNow you can adjust some settings and default in user settings if you have an account\\n\\n![user prefs](./img/user-preferences.png)\\n\\n### Run results diff highlight\\n\\nNow you can click on result row to highlight parameter difference relative to click row\\n\\n![run highlight](./img/run-highlight.png)\\n\\n### Performance regression\\n\\nWe\'ve added simple form to catch regressions in speed\\nList of URLs can be configured via config options\\n\\n![perf test](./img/perf-test.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udc77\u200d Build System\\n\\n* **docker:** add docker for easily bootstrapping dev env ([f0da04d](https://github.com/ts-factory/bublik-ui/commit/f0da04db315506a64d04e8932f265fc0be6d250f))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n* **providers:** [tooltip] disable hoverable content ([dc6baf5](https://github.com/ts-factory/bublik-ui/commit/dc6baf5ee560c7ed9881802efde702607def69b4))\\n* **ui:** [checkbox] not updating on label click ([3475b01](https://github.com/ts-factory/bublik-ui/commit/3475b01081281b6766da0cd691df52d2c5aa1efc))\\n\\n#### \ud83d\ude80 New Feature\\n\\n* **log:** make log page respect user preferences ([ef5ebe3](https://github.com/ts-factory/bublik-ui/commit/ef5ebe34c5c9954252dc0d3cebfe09af2a273c45))\\n* **performance:** add view for bublik performance self-testing ([2a3619b](https://github.com/ts-factory/bublik-ui/commit/2a3619b4dc8f3258459d84e3816fb5c5bd3060b9))\\n* **run:** add ability to highlight param difference ([b75d295](https://github.com/ts-factory/bublik-ui/commit/b75d2956820c99673e4516d7ffa9522cdcb7a205))\\n* **ui:** add radio group component ([aa27baa](https://github.com/ts-factory/bublik-ui/commit/aa27baa741f637dcdb39235b5233f1506c0653f8))\\n* **user:** [preferences] add user preferences form ([2ce58ce](https://github.com/ts-factory/bublik-ui/commit/2ce58cebce2e08bf884f2669e0fbb3aa57fa5ba3))\\n\\n### Backend\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **history:** fix filtering by expressions ([e808026](https://github.com/ts-factory/bublik/commit/e808026a549b193e0caa66afcb64ffe370d4afd2))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **performance:** add performance check ([d27a9fe](https://github.com/ts-factory/bublik/commit/d27a9fedd4875165ac3bea9dec3b0f15744b12d3))"},{"id":"release-v0.2.2","metadata":{"permalink":"/bublik-release/blog/release-v0.2.2","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-02-01-release-v0.2.2/index.mdx","source":"@site/blog/2024-02-01-release-v0.2.2/index.mdx","title":"Release v0.2.2","description":"We are happy to announce Bublik v0.2.2.","date":"2024-02-01T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":1.88,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null}],"frontMatter":{"title":"Release v0.2.2","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.2.2"},"unlisted":false,"prevItem":{"title":"Release v0.2.3","permalink":"/bublik-release/blog/release-v0.2.3"},"nextItem":{"title":"Release v0.2.1","permalink":"/bublik-release/blog/release-v0.2.1"}},"content":"We are happy to announce **Bublik v0.2.2**.\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n## Improved history speed\\n\\nWe have improved the speed of the history page by optimizing the backend SQL queries.\\n\\n## Improved import logs\\n\\nNow you can see logs of the import process in real-time while the import is running.\\n\\n![Import logs](./img/import-log.png)\\n\\n:::info\\nLogs updated every 5 seconds.\\n:::\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udd27 Continuous Integration | CI\\n\\n- **release,ci:** fix formatting and pass env through global config ([03b1dab](https://github.com/ts-factory/bublik-ui/commit/03b1dab85d780bc0fd71b2277fd451c6a8a780bc))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **import:** fix import table overflowing horizontally ([b66d49c](https://github.com/ts-factory/bublik-ui/commit/b66d49ce41918861f9425452610e9a213e8eca17))\\n- **ui:** [toaster] add colors for different states ([2955b94](https://github.com/ts-factory/bublik-ui/commit/2955b94a3611e6129b20fe19da71326fb25d9b6e))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **import:** add live import logs via polling for changes ([75ab1b1](https://github.com/ts-factory/bublik-ui/commit/75ab1b1a51e548b86c4e4235b61de54f48516bd0))\\n- **run:** add tip for ctrl+click on run page ([5ca2912](https://github.com/ts-factory/bublik-ui/commit/5ca29124d42b79c8a76c662ee0dcad1a7fc2329c))\\n\\n#### \ud83d\udce6 Chores\\n\\n- **auth:** allow access to dev section for unauthenticated users ([b7f83f2](https://github.com/ts-factory/bublik-ui/commit/b7f83f26546526ce9d458c1860af967de82e35de))\\n- **nx:** upgrade nx and it\'s packages to latest versions ([ad45ca6](https://github.com/ts-factory/bublik-ui/commit/ad45ca634506812fdbcd8999f39852cd64f3f484))\\n- **storybook:** cleanup unused imports/types ([e1039f2](https://github.com/ts-factory/bublik-ui/commit/e1039f25d7dbaa75f2070909cd7f7134ca8e33e0))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **build:** adjust release config to allow releases from branches other than `main` ([22a6f6b](https://github.com/ts-factory/bublik-ui/commit/22a6f6be3555e509f16ed7c1b0999dd2d98501d5))\\n- **import:** [import-form] allow empty URL ([33347a3](https://github.com/ts-factory/bublik-ui/commit/33347a30152a6faafb6b5fe9ee6d16a0485faef1))\\n- **log:** fix json log overflow scrolling not working ([537677c](https://github.com/ts-factory/bublik-ui/commit/537677cf6729cacb226645fc9fb905430bf2a535))\\n\\n### Backend\\n\\n#### \ud83d\udd28 Issue Fix\\n\\n- Error on measurement results processing during live import [#2](https://github.com/ts-factory/bublik/issues/2)\\n- Error in calculating detailed run statistics [#3](https://github.com/ts-factory/bublik/issues/3)\\n- Live import: incorrect call to the do\\\\_nothing() function [#5](https://github.com/ts-factory/bublik/issues/5)\\n- \\"IndexError: list index out of range\\" on meta categorization request [#8](https://github.com/ts-factory/bublik/issues/8)\\n- Unclear logs message: no priority was specified, defaulting to 4 [#9](https://github.com/ts-factory/bublik/issues/9)\\n- Logs ticket service should not be restarted if Kerberos keytab is not configured [#12](https://github.com/ts-factory/bublik/issues/12)\\n- Revive and improve initial deploy script to simplify first time setup [#13](https://github.com/ts-factory/bublik/issues/13)\\n\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **importruns:** fix sending failed mails ([bdc1ec0](https://github.com/ts-factory/bublik/commit/bdc1ec0c38e9f8fe4e852520e0e9614e7c48aa70))\\n- **importruns:** fix import log link ([0f177f4](https://github.com/ts-factory/bublik/commit/0f177f49f5d2967f51d88259dc584081c18ca6cc))\\n\\n#### \u26a1 Performance\\n\\n- **history:** speed up history by optimizing DB queries ([1a767ec](https://github.com/ts-factory/bublik/commit/1a767ecb51d00774506979d2b5f01a01c0ca8601))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **deploy:** add services stop option ([09082fd](https://github.com/ts-factory/bublik/commit/09082fd5abed4eee556736b4102ad85f28b7b02b))\\n- **deploy:** make services restart by default ([87f6501](https://github.com/ts-factory/bublik/commit/87f6501557fd6804b5c0fe42b0e5cf53db0f7e84))\\n- **deploy:** add the option to quietly restart services ([409066e](https://github.com/ts-factory/bublik/commit/409066e9d1f3fe0c8e646d3c43ea8cbac569317a))\\n\\n#### \ud83d\udcbe DB Changes\\n\\n- **models:** speed up history by speed up meta filtering ([4f94f7c](https://github.com/ts-factory/bublik/commit/4f94f7c84654b833d5497611357a177342bfc0d6))\\n\\n#### \ud83d\udce6 Chores\\n\\n- **auth:** unify response messages ([a8aeda6](https://github.com/ts-factory/bublik/commit/a8aeda68ac45df5b6c2dcaf61618fa0a3374bc2c))\\n- **cleanup:** unify quotes in error messages ([6d832cb](https://github.com/ts-factory/bublik/commit/6d832cbeb711bc9095b7f0340ade64279e2b3024))\\n- **deploy:** remove an extra duplicate function ([a681cab](https://github.com/ts-factory/bublik/commit/a681cab70bf9c3dd670039e8a41dbd93914d43ee))"},{"id":"release-v0.2.1","metadata":{"permalink":"/bublik-release/blog/release-v0.2.1","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2023-12-29-release-v0.1.11/index.mdx","source":"@site/blog/2023-12-29-release-v0.1.11/index.mdx","title":"Release v0.2.1","description":"We are happy to announce Bublik v0.2.1.","date":"2023-12-29T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":3.745,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas","page":null}],"frontMatter":{"title":"Release v0.2.1","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.2.1"},"unlisted":false,"prevItem":{"title":"Release v0.2.2","permalink":"/bublik-release/blog/release-v0.2.2"},"nextItem":{"title":"Release v0.1.10","permalink":"/bublik-release/blog/release-v0.1.10"}},"content":"We are happy to announce **Bublik v0.2.1**.\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n### Authentication Module\\nAt the moment, the Bublik authentication module exists separately from the rest of the Bublik functionality. If you want to test its work, you can contact the developer of the Bublik.\\n\\n:::info\\nThe authentication module in the Bublik has nothing to do with authentication on the server. Thus, you cannot access the system using your server credentials. To access the system, you need to be registered directly in the Bublik authentication module.\\n:::\\n\\n#### User\\n\\n\\n\\n![Login form](./img/auth.png)\\n\\nRegistration\\nUsers who are not project administrators are registered in the system by the administrator. After user registration, a verification link will be sent to the email address specified during registration. The user will be able to log in only after confirming the email address by clicking on the link from the incoming email.\\n\\nProfile page\\n\\n![Profile page](./img/profile.png)\\n\\nFeatures\\n- update your first and last name;\\n- change the password from your profile;\\n- reset the password via email.\\n\\n#### Administrator\\n\\nAdmin management table\\n\\n![Admin](./img/admin-users.png)\\n\\nRegistration\\nIf you are the administrator of the project and want to be registered in the system, please contact the administrator of the Bublik.\\n\\nFeatures\\n- update your first and last name;\\n- change the password from your profile;\\n- reset the password via email;\\n- view the list of users;\\n- create a user;\\n- change the user\'s first name, last name and password;\\n- deactivate the user.\\n\\n\\n:::info\\nOnly one user can be registered to one email address.\\nIn this release we\'ve added authentication with access to profile and user management for admins\\n:::\\n\\n### Runs\\n\\nWe\'ve added new mode for runs page which contains various charts to get an easy overview of filtered runs\\n\\n:::info\\nSome charts are clickable\\n:::\\n\\n![Runs charts](./img/runs-charts.png)\\n\\n### History expressions\\n\\nAdded expression support for multiple history fields\\n\\n![History expressions](./img/history-fields.png)\\n\\n### Import logs\\n\\nIntegrated import logs\\n\\n![Import logs](./img/import-logs.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **dashboard:** add popover button with icon and comment if run is marked as compromised\\n- **dashboard:** add TV mode for dashboard for fullscreen viewing\\n- **auth:** add authentication\\n- **auth:** add user profile page\\n- **import:** integrate import logs inside bublik\\n- **history:** sync client filter state with search params\\n\\n#### \ud83d\udc85 Polish\\n\\n- **ui** improve scrollbar behaviour when main container is overflowing\\n- **ui** convert all colors to HSL with support of opacity\\n- **dashboard** replace dashboard mode icons with updated ones\\n- **dashboard** make dashboard errors to display properly\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **dashboard** failing recursively on dashboard fetch error\\n- **dashboard** not fetching dashboard when run is marked as compromised\\n- **history** changing date in form and closing not picking correct date\\n- **history** changing mode when no page exists returns 404\\n\\n#### \u267b Code Refactoring\\n\\n- **dashboard** refactor dashboard table as well as search params\\n\\n#### \ud83d\udc77\u200d Build System\\n\\n- **ci** update ci/cd actions to latest versions\\n\\n### Backend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **import log** create API to return JSON import log\\n- **auth** add the ability to register users ([fb0a439](https://github.com/ts-factory/bublik/commit/fb0a4390ae22e4b6cdbcd3d29f89ea467a542195))\\n- **auth** add the ability to log in ([6428320](https://github.com/ts-factory/bublik/commit/6428320b4517603bd4f49e151658748a5d9a1f28))\\n- **auth** add the ability to get user info ([e438cc5](https://github.com/ts-factory/bublik/commit/e438cc5950966a8265a484a93c890e056a9ec643))\\n- **auth** add the ability to refresh access token ([8911464](https://github.com/ts-factory/bublik/commit/891146419ec10df9777147ec581b05f502fbc0d0))\\n- **auth** add the ability to log out ([ffb2c80](https://github.com/ts-factory/bublik/commit/ffb2c80079020347fc649ea9df633fa78cb82730))\\n- **auth** add the ability to reset password by email ([70f4c50](https://github.com/ts-factory/bublik/commit/70f4c50baf99ec8cc1bf226185216cfb064ea6c3))\\n- **auth** add the ability to reset password from the profile ([9d43203](https://github.com/ts-factory/bublik/commit/9d43203d9163536d56331ae982edb807725f0aff))\\n- **auth** add admin functions and admin verification ([e6a4e50](https://github.com/ts-factory/bublik/commit/e6a4e50d2ca8371d0225b5473fe54d60c6048cda))\\n- **auth** add the ability to update user info yourself ([30a0029](https://github.com/ts-factory/bublik/commit/30a0029ec585e57e159d77ae9bb2750d84271e9c))\\n- **history** separate expressions by meta types\\n- **history** add verdicts expression\\n- **history** add test arguments expression\\n\\n#### \ud83d\udcbe DB changes\\n\\n- **auth** add a custom User model\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **import** fix import from bublik.xml\\n- **urls** fix dashboard redirect to v2\\n- **log** check the ID and the page query parameter value\\n- **run stats** take into account DU value when calculating run conclusion\\n- **run stats** fix abnormal counter\\n- **history** change error reporting in filtering by expressions\\n- **history** fix filtering by expressions\\n- **history** fix a list of IDs of filtered runs generation\\n\\n#### \u270f\ufe0f Other\\n\\n- **API v1 removal** move redirection to flower to other redirects\\n- **API v1 removal** move meta categorization web interface to API v2\\n- **API v1 removal** move import log web interface to API v2\\n- **API v1 removal** extend the functionality of the import via API v2"},{"id":"release-v0.1.10","metadata":{"permalink":"/bublik-release/blog/release-v0.1.10","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2023-10-22-release-v0.1.10/index.mdx","source":"@site/blog/2023-10-22-release-v0.1.10/index.mdx","title":"Release v0.1.10","description":"We are happy to announce Bublik v0.1.10.","date":"2023-10-22T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":2.185,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/ol-limonikas","imageURL":"https://github.com/ol-limonikas.png","key":"ol-limonikas","page":null}],"frontMatter":{"title":"Release v0.1.10","authors":["ol-limonikas"],"tags":["release"],"slug":"release-v0.1.10"},"unlisted":false,"prevItem":{"title":"Release v0.2.1","permalink":"/bublik-release/blog/release-v0.2.1"},"nextItem":{"title":"Release v0.1.8","permalink":"/bublik-release/blog/release-v0.1.8"}},"content":"We are happy to announce **Bublik v0.1.10**.\\nIn this release we focused mainly on improving existing pages and refining user experience\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n### Floating log table filter toolbar\\n\\nWe\'ve added toolbar floating toolbar at the top of log table to allow access to filters when scrolled after\\n\\n![Button to open toolbar](./img/toolbar-1.png)\\n\\n![Opened toolbar](./img/toolbar-2.png)\\n\\n### Log time\\n\\nYou can now see time delta relative to selected row if you enable \\"time delta mode\\"\\n\\n![Log delta](./img/delta-1.png)\\n\\n### Improved sidebar scrolling\\n\\nWe improved sidebar scrolling\\n\\n:::info\\nIn collapsed state sidebar will expand links for active page only\\n:::\\n\\n:::tip\\nYou can press `S` on keyboard to open or collapse sidebar without clicking\\n:::\\n\\n![Sidebar](./img/sidebar-1.png)\\n\\n### Reworked import form\\n\\n:::tip\\nYou can paste multiple URLs separated by space or newline character to prefill the form faster\\n:::\\n\\n![Import form](./img/import-form-1.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n## [0.26.0] (2023-10-20)\\n\\n### \ud83d\ude80 New Feature\\n\\n- **router:** start loading whole app with spinner\\n- **ui:** [form-alert]: add form alert component\\n- **ui:** [sidebar] improve scrollbar behaviour for sidebar\\n- **log:** add floating toolbar\\n\\n### \ud83d\udc1b Bug Fix\\n\\n- **import:** base query not adding prefix in queryFn\\n- **log:** animation not working for highlighting row\\n- **log:** properly handle errors from JSON API\\n- **diff:** improve error message when no ids selected\\n- **types:** remove runs config type from router\\n- **auth:** [login-form] display error when invalid credentials provided\\n- **run:** [page] not prefetching tree in log page\\n\\n### \ud83d\udce6 Chores\\n\\n- **changelog:** [confetti] remove changelog modal\\n- **import:** add 4 default rows for import\\n- **sidebar:** remove tests link from sidebar\\n- **log:** change title of log level\\n- **nx:** migrate to latest nx\\n- **ui:** fix some react keys logic\\n- cleanup old todos\\n\\n### \ud83d\udc85 Polish\\n\\n- **dashboard:** fix border-radius not being consistent in header\\n- **log:** fix floating button overlaying toolbar popovers\\n- **run:** add styles for sorted columns\\n- **log:** add partially expanded row color\\n- **log:** emphasize floating toolbar button styles\\n- **log:** fix styling for wrapped file block\\n- **log:** improve line breaking for pre-formatted elements\\n- **log:** improve word breaking\\n- **log:** move log bgs to css variables\\n- **ui:** [button] missing border in disabled state\\n- **vars:** change all colors to hsl and allow opacity change\\n- **vars:** fixs overlay opacity\\n\\n### \u267b Code Refactoring\\n\\n- **router:** remove all lazy loaded components\\n- **log:** expand log to level 1 by default\\n- **log:** extract pagination logic into hooks\\n- **log:** improve error messages for JSON logs\\n- **log:** re-arrange log levels via weight parameter\\n\\n### \u2705 Tests\\n\\n- **ui:** update snapshot tests for new css vars"},{"id":"release-v0.1.8","metadata":{"permalink":"/bublik-release/blog/release-v0.1.8","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2023-08-09-release-v0.1.8/index.mdx","source":"@site/blog/2023-08-09-release-v0.1.8/index.mdx","title":"Release v0.1.8","description":"We are happy to announce Bublik v0.1.8.","date":"2023-08-09T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":1.51,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/ol-limonikas","imageURL":"https://github.com/ol-limonikas.png","key":"ol-limonikas","page":null}],"frontMatter":{"title":"Release v0.1.8","authors":["ol-limonikas"],"tags":["release"],"slug":"release-v0.1.8"},"unlisted":false,"prevItem":{"title":"Release v0.1.10","permalink":"/bublik-release/blog/release-v0.1.10"},"nextItem":{"title":"Release v0.1.5","permalink":"/bublik-release/blog/release-v0.1.5"}},"content":"We are happy to announce **Bublik v0.1.8**.\\nIn this release we focused mainly on improving charts usability.\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n### Ability to open charts in fullscreen mode\\n\\nYou can now open most of the charts in fullscreen mode\\n\\n![Fullscreen chart button](./img/fullscreen-chart-1.png)\\n\\n![Fullscreen chart](./img/fullscreen-chart-2.png)\\n\\n### Ability to compose multiple charts onto one plot\\n\\n:::info\\nWe are considering moving this view to separate page to allow URL sharing\\n:::\\n\\n![Fullscreen chart](./img/charts-combined-1.png)\\n\\n![Fullscreen chart](./img/charts-combined-2.png)\\n\\n### New runs badge input\\n\\nWe have added new badge input to runs page that should be working better then before.\\nWe are currently looking at changing history badge input and moving it to separate modal with input looking like on the runs page.\\n\\n![Badge input button](./img/badge-1.png)\\n\\n![Badge input](./img/badge-2.png)\\n\\n### Time delta\\n\\n:::warning\\nThis is not final design and UI improvements would be made regarding colors\\n:::\\n\\n![Delta](./img/delta-1.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **log:** time delta not working correctly with timestamps\\n- **ui:** [tags-box-input] removing selected items\\n\\n#### \u267b Code Refactoring\\n\\n- **ui:** [chart] replace chart toolbar with updated\\n\\n#### \ud83d\udc85 Polish\\n\\n- **history:** [plot-list] add shadow to header when sticky\\n- **history:** [refresh] fix animation origin\\n- **measurements:** improve measurements chart layout\\n- **ui:** [button] don\'t allow click when loading\\n- **ui:** [chart] add more space in fullscreen mode\\n- **ui:** [export-button] fix icon and styles\\n- **ui:** [link] missing animation when loading\\n\\n#### \ud83d\udce6 Chores\\n\\n- **log:** add timestamp mock\\n- **measurements:** [chart] remove plot with series\\n- **ui:** [chart] adjust icon sizes\\n- **ui:** [chart] improve voice over labels\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **history, measuremensts:** add fullscreen chart\\n- **history:** [chart] add ability to view charts with multiple Y axises\\n- **ui:** [toolbar] add toolbar component\\n- **log:** add timestamp delta with anchor\\n\\n#### \u2705 Tests\\n\\n- **history, import:** update snapshot tests"},{"id":"release-v0.1.5","metadata":{"permalink":"/bublik-release/blog/release-v0.1.5","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2023-05-31-release-v0.1.5/index.mdx","source":"@site/blog/2023-05-31-release-v0.1.5/index.mdx","title":"Release v0.1.5","description":"We are happy to announce Bublik v0.1.5","date":"2023-05-31T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":3.655,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/ol-limonikas","imageURL":"https://github.com/ol-limonikas.png","key":"ol-limonikas","page":null}],"frontMatter":{"title":"Release v0.1.5","authors":["ol-limonikas"],"tags":["release"],"slug":"release-v0.1.5"},"unlisted":false,"prevItem":{"title":"Release v0.1.8","permalink":"/bublik-release/blog/release-v0.1.8"},"nextItem":{"title":"Release v0.1.3","permalink":"/bublik-release/blog/release-v0.1.3"}},"content":"We are happy to announce **Bublik v0.1.5**\\nIn this release we added initial support for new log UI. Added ability to open/collapse sidebar menus.\\nMany more style and internal changes\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n### Reworked sidebar\\n\\nWe\'ve added ability to show/hide collapsed menus inside sidebar at any time. Now you can jump back and forth between different pages\\n\\n:::tip\\nAlso you can now hide/show sidebar by pressing **`S`** on the keyboard\\n:::\\n\\n![Reworked sidebar](./img/Capture-2023-06-09-103917.png)\\n\\n### New changelog UI\\n\\nWe also added changelog\\n\\n![New changelog](./img/Capture-2023-06-09-104647.png)\\n\\n### Reworked run toolbar\\n\\nWe\'ve moved toolbar with various buttons\\n\\n![Reworked toolbar](./img/Capture-2023-06-09-104900.png)\\n\\nAdded ability to hide/show columns via dropdown menu\\n\\n![Toggle run table columns](./img/Capture-2023-06-09-105115.png)\\n\\n### Opening NOK results on link click\\n\\nYou can now go to run with opened results by clicking on NOK with `Ctrl+click`\\n\\n![Nok results](./img/Capture-2023-06-09-105620.png)\\n\\n### New log UI\\n\\n:::warning\\nThis is experimental feature and may not work as expected!\\n:::\\n\\nIn this release we started to integrate new log UI this is still work in progress.\\nWe want to hear your feedback and features you maybe want :)\\n\\n![New log UI](./img/Capture-2023-06-09-110507.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udcdd Documentation\\n\\n- **config:** adjust docs to new build pipeline\\n\\n#### \ud83d\udc77\u200d Build System\\n\\n- **size:** extract echarts chunk manulally to reduce size\\n- **vite:** add ability to specify remote JSON logs storage\\n\\n#### \ud83d\udd27 Continuous Integration | CI\\n\\n- **build:** fix failing to parse passed args\\n- **build:** skip changelog for beta releases\\n\\n#### \u267b Code Refactoring\\n\\n- **icon:** convert all icons to `.svg`\\n- **run:** change displayed run columns\\n- **ui:** replace all skeletons with component\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **history:** lazy loading modules\\n- **log:** [frame] not saving line number on subsequent navigations\\n- **runs:** date range picker no label warning\\n- **runs:** importing from lazy loaded module\\n\\n#### \ud83d\udc85 Polish\\n\\n- **animation:** [dialog] add animation to dialog content\\n- **changelog:** add confetti explosion on new release\\n- **history:** add animation to context menu\\n- **history:** align reset buttons with close button\\n- **import:** fix overflow scrollbars\\n- **import:** make modal title bigger\\n- **run:** [table] add group columns with border\\n- **run:** add background on row hover\\n- **run:** uppercase table columns\\n- **tooltip:** change shadow\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **ci:** add changelog to the ui\\n- **faq:** add latest tag info\\n- **formatting:** convert formatting to use tabs\\n- **log:** add experimental support for JSON logs\\n- **log:** add initial support for displaying log content\\n- **log:** add pagination support to schema\\n- **log:** add pagination support to schema\\n- **run:** [results-table] add key list with URLs\\n- **run:** add column visibility toggle to run/diff pages\\n- **run:** add tooltips to details/toolbar buttons\\n- **sidebar:** add collapsible links\\n- **sidebar:** show/hide sidebar on `s` keypress\\n- **ui:** add dropdown menu component\\n- **ui:** add skeleton component\\n\\n#### \u23ea Reverts\\n\\n- **log:** [frame] not saving line number on navigations\\n- **run:** rollback renaming column ids for run table\\n\\n#### \u2705 Tests\\n\\n- **ci:** fix lint command\\n- **e2e:** add playwright support\\n- **history:** add some snapshot tests to history\\n- **import:** fix snapshot for overflow table\\n- **import:** fix snapshot test for loading table state\\n- **log:** remove build target from lib\\n- **run:** fix div instead of button when no URL present\\n- **ui:** [clock] fix timezone issue in CI\\n- **ui:** [icon] fix svgr not loading in vitest\\n\\n#### \ud83d\udce6 Chores\\n\\n- **build:** migrate from webpack to vite\\n- **build:** upgrade vite to v4.3\\n- **changelog:** [modal] disable modal until checkbox is ready\\n- **changelog:** lazy load changelog\\n- **ci:** add new commit types\\n- **ci:** fix compare URL\\n- **ci:** update pipeline for manual releases\\n- **deploy:** adjust API for new JSON format\\n- **env:** move all env configs to bublik app config\\n- **log:** add run ID to tab title\\n- **log:** remove zod schema converting to JSON from production bundle\\n- **nx:** upgrade nx to 16.2.1\\n- **release:** v0.16.0\\n- **test:** update snapshots\\n\\n### Backend\\n\\n#### \ud83d\udc85 Polish\\n\\n- update run stats structure\\n- reduce the number of requests when fetching the result details\\n- reduce the number of queries to the DB for retrieving metas and test arguments\\n- recalculate stats for the previously imported runs\\n- avoid measurement results dups after live import\\n\\n#### \ud83d\ude80 New Feature\\n\\n- implement the new API to get JSON log URL\\n- add runtime to the import table"},{"id":"release-v0.1.3","metadata":{"permalink":"/bublik-release/blog/release-v0.1.3","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2023-03-17-release-v0.1.3/index.mdx","source":"@site/blog/2023-03-17-release-v0.1.3/index.mdx","title":"Release v0.1.3","description":"We are happy to announce Bublik v0.1.3","date":"2023-03-17T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":1.26,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/ol-limonikas","imageURL":"https://github.com/ol-limonikas.png","key":"ol-limonikas","page":null}],"frontMatter":{"title":"Release v0.1.3","authors":["ol-limonikas"],"tags":["release"],"slug":"release-v0.1.3"},"unlisted":false,"prevItem":{"title":"Release v0.1.5","permalink":"/bublik-release/blog/release-v0.1.5"},"nextItem":{"title":"Release v0.1.2","permalink":"/bublik-release/blog/release-v0.1.2"}},"content":"We are happy to announce **Bublik v0.1.3**\\n\\nAdded features, bugs and more!\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n### New icon for skipped tests\\n\\n![Log page tree skipped tests](./img/SCR-20230318-chrl.png)\\n\\n### Added more data to import event table\\n\\n![Import page table](./img/SCR-20230318-cjpi.png)\\n\\n### New form for importing multiple runs at once\\n\\n![Import multiple runs at once](./img/SCR-20230317-hkff.png)\\n\\n![Import list results](./img/SCR-20230317-hlar.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- feat(dashboard): expand NOK result on link click for `unexpected`\\n- feat(import): add form for importing multiple runs at once\\n- feat(import): add filter by task id, error message, log URL to form\\n- feat(log): mark skipped tests with icon\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- fix(import): fix sidebar not sticking when table overflows page\\n\\n#### \ud83d\udc85 Polish\\n\\n- style(import): fix header dissapearing on when error present\\n- style(import): overflowing table should be scrollable\\n- chore(history): format dates in header legend\\n\\n---\\n\\n### Backend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- change the error message structure\\n- add \'skipped\' info to the iteration data forwarded to the UI\\n- add new endpoint /v2/importruns/source to make imports from import status table\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- runs import without logs\\n\\n#### \u270f\ufe0f Other\\n\\n- add facility, severity, timestamp and Error message to the import statuses table\\n- add filtration by Celery task ID, Error message, Log URI to the import statuses table\\n- change the format of storing the expected result keys\\n- move key parsing from the import stage to the statistics generation stage\\n- add support for \\"ref://type/tail\\" keys to key parsing"},{"id":"release-v0.1.2","metadata":{"permalink":"/bublik-release/blog/release-v0.1.2","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2023-02-20-release-v0.1.2/index.mdx","source":"@site/blog/2023-02-20-release-v0.1.2/index.mdx","title":"Release v0.1.2","description":"We are happy to announce Bublik v0.1.2","date":"2023-02-20T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":1.73,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/ol-limonikas","imageURL":"https://github.com/ol-limonikas.png","key":"ol-limonikas","page":null}],"frontMatter":{"title":"Release v0.1.2","authors":["ol-limonikas"],"tags":["release"],"slug":"release-v0.1.2"},"unlisted":false,"prevItem":{"title":"Release v0.1.3","permalink":"/bublik-release/blog/release-v0.1.3"},"nextItem":{"title":"Release v0.1.1","permalink":"/bublik-release/blog/release-v0.1.1"}},"content":"We are happy to announce **Bublik v0.1.2**\\n\\nIn this release we focused on more robust error experience, so you can have more context on what exactly went wrong.\\nAlso, we added more self-describing tab names, so you can easily find what you are looking for.\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n## Error details\\n\\n### Example error\\n\\n![Error details](./img/history-error.png)\\n\\n## History context menu\\n\\n:::info\\nSelecting tags will apply filters and refetch the data. <br/>\\nIt works just like clicking refresh button\\n\\n:::\\n\\n![History context menu](./img/history-context-menu.png)\\n\\n## Tab names\\n\\n### Example tab names\\n\\n![Tab names](./img/tabs.png)\\n\\n## Details diff\\n\\n### Example diff\\n\\n![Details diff](./img/details-diff.png)\\n\\n## Event logs\\n\\n### Example event logs table\\n\\n![Events logs table](./img/event-log.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- feat(history): add reset button to history global filter form\\n- feat(history): add context menu to history linear/aggregation tables\\n- feat(help): bake frontend revisions into deploy-info component at build time\\n- feat(dev): add events table with celery task status and links to logs/flower\\n- feat(run-diff): [details] add diff for run info details\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- fix(history): remove unnecessary requests if no test name is found\\n- fix(history): failing to parse URL search params on some requests\\n- fix(runs): add total percentage of expected runs\\n- fix(run-diff): don\'t show suspence loading spinner for run-diff page\\n- fix(dev): flower URL is incorrect in iframe\\n- fix(ui): [datepickers] wrong order of date segments and wrong literals\\n\\n#### \ud83d\udc85 Polish\\n\\n- style(history): add backdrop blur for dialogs\\n- style(history): place duration in column to save some space\\n- style(run): add empty state for run page\\n- chore(sidebar): move flower/import/tests links under dev menu\\n\\n---\\n\\n### Backend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- the table of import statuses is added to the dev section\\n\\n#### \ud83d\udcbe DB changes\\n\\n- added a new model - EventLog to log Bublik events\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- parse and show plan info\\n\\n#### \u270f\ufe0f Other\\n\\n- persistent option added to the Flower service to save Celery tasks after services restart\\n- changes applied to gunicorn and nginx to change max buffer and size of URIs"},{"id":"release-v0.1.1","metadata":{"permalink":"/bublik-release/blog/release-v0.1.1","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2023-01-20-release-v0.1.1/index.mdx","source":"@site/blog/2023-01-20-release-v0.1.1/index.mdx","title":"Release v0.1.1","description":"We are happy to announce Bublik v0.1.1","date":"2023-01-20T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/bublik-release/blog/tags/release"}],"readingTime":3.515,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/ol-limonikas","imageURL":"https://github.com/ol-limonikas.png","key":"ol-limonikas","page":null}],"frontMatter":{"title":"Release v0.1.1","authors":["ol-limonikas"],"tags":["release"],"slug":"release-v0.1.1"},"unlisted":false,"prevItem":{"title":"Release v0.1.2","permalink":"/bublik-release/blog/release-v0.1.2"}},"content":"We are happy to announce **Bublik v0.1.1**\\n\\nWe\'ve added experimental support for comparing two runs, new datepicker component with better accessibility and keyboard navigation, new page mode for history where you can see values change over time and more.\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n## Run Diff\\n\\n:::warning\\n\\nThis feature is experimental and may not work as expected\\n\\n:::``\\n\\n### Diff view\\n\\nIn this release we\'ve added experimental support for comparing two runs\\n\\n![Run diff page](./img/run-diff-page.png)\\n\\n### Access diff from runs page\\n\\nYou can now click on two run rows on runs page and select `Compare` button to compare them\\n\\n![Runs selection](./img/runs-to-diff.png)\\n\\n### Access diff from run page\\n\\nYou can access this page via `Run` -> `Compare` button\\n\\n![Compare button](./img/compare-button.png)\\n\\n---\\n\\n## History\\n\\n### Filter Reset\\n\\nYou can now reset client side filters in history page\\n\\n:::info\\n\\nSometimes client side filters _(click search)_ may not work as expected. In this case you can reset them by clicking on `Reset filters` button\\n\\n:::\\n\\n![History reset filters](./img/history-reset-filters.png)\\n\\n### Measurements\\n\\nWe\'ve also added a new page mode for history where you can see values change over time\\n\\n![History charts](./img/history-charts.png)\\n\\n#### Measurement Info\\n\\nYou can click on chart point to bring up modal with additional information as well as ability to jump directly to log/measurements/run\\n\\n![History charts modal](./img/history-chart-modal.png)\\n\\n---\\n\\n## New Date pickers\\n\\nWe\'ve added new datepicker component with better accessibility and keyboard navigation\\n\\n### Datepicker\\n\\n![Datepicker](./img/datepicker.png)\\n\\n### Date-range picker\\n\\n![Date range picker](./img/date-range-picker.png)\\n\\n---\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- feat: add new datepicker component with better accessibility\\n- feat: add new datepicker range component with better accessibility\\n- feat(run): add URL state handling for run table\\n- feat(run): add ability to compare runs via form in run\\n- feat(run): add skeleton loading for run details state\\n- feat(run-diff): add initial run-diff page\\n- feat(measurements): add suspended ui and skeleton for history measurements\\n- feat(log): add skeleton loading to log tree\\n- feat(help): add better error message when couldn\'t fetch revisions\\n- feat(history): add reset client side filters button to history\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- fix(run): `crtl + click` not applying filters to subtree\\n- fix(run-diff): change the way arrow direction is decided for run-diff\\n- fix(run-diff): improve package matching\\n- fix(help): tooltip with revision info not working\\n- fix(measurements): gap in value table column\\n- fix: enable horizontal scroll for badge input by default\\n- fix(measurements): export crashing on empty values\\n- refactor(runs): rewrite runs page with better architecture\\n- refactor(history): rewrite history page with better architecture\\n\\n#### \ud83d\udc85 Polish\\n\\n- fix(history): don\'t reset date range field in history global search\\n- feat(history): add history skeleton on no results found\\n- chore(history): add border around table rows\\n- feat(runs): add skeleton when no results found\\n- chore(runs): add border around table rows\\n- fix: badge rendering as button when no `onClick` handler passed\\n\\n---\\n\\n### Backend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- meta_categorization: change the approach of categorizing metas\\n- commands: add command to add tags extracted from the log\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- measurements: change the json forwarded to the UI\\n- measurements: increase the speed of processing by using faster sorting and filtering methods for DB objects\\n- measurements: create proper objects in DB when handling measurements\\n- charts: add axises_config and axises titles to the json forwarded to the UI\\n- charts: combine chart that differ only in comments\\n- history: increase the speed by using proper filtration of test results, test runs, results and test\\n- importruns: change an option forwarded to rgt-log-bundle-get-original from TE since it has changed in TE itself\\n- importruns: change the handling of measurements import errors\\n- hash: the default hashing algorithm was changed to avoid creating duplicates in DB\\n- metas: add check for STATUS meta in `meta_data.json`\\n- metas: update metas even if the run is not completed\\n- cache: update cache after new meta categorization process\\n- celery: add option to specify number of task after completing which the worker will be reloaded\\n- run_diff: add execution sequence to the data provided to UI to show run_diff\\n- result_summary: return only summary values not the whole results\\n\\n  #### Other changes\\n\\n- coding_style: apply **black**, **flynt**, **unify** and **isort** to the whole project"}]}}')}}]);